VERSION="1.0.2" # Add support for Kinetic Kudu (22.10) and Ubuntu-Unity ISOs
MAINLINE_URL="http://kernel.ubuntu.com/~kernel-ppa/mainline"
SUPPORTED_OS=("Ubuntu" "Ubuntu-Unity" "Kubuntu" "Lubuntu" "Ubuntu-Budgie" "Ubuntu-GNOME" "Ubuntu-MATE" "Xubuntu" "Mint")
LONG_FLAGS_WITH_ARGUMENTS=("kernel" "repository" "erase" "package" "local-package" "file" "boot" "iso" "work-directory" "command" "grub" "key")
LONG_FLAGS_WITHOUT_ARGUMENTS=("help" "version" "check" "update" "dist-upgrade" "upgrade" "interactive" "debug" "all" "disk")
LONG_FLAGS=("${LONG_FLAGS_WITH_ARGUMENTS[@]}" "${LONG_FLAGS_WITHOUT_ARGUMENTS[@]}")
NEEDS_AN_ARGUMENT=("k" "r" "e" "p" "l" "f" "b" "i" "w" "c" "g")
DOES_NOT_NEED_AN_ARGUMENT=("${LONG_FLAGS_WITHOUT_ARGUMENTS[@]}")
# based on /usr/share/distro-info/ubuntu.csv
RELEASE_CODENAME=("trusty" "utopic" "vivid" "wily" "xenial" "yakkety" "zesty" "artful" "bionic" "cosmic" "disco" "eoan" "focal" "groovy" "hirsute" "impish" "jammy" "kinetic")
RELEASE_VERSION=("14.04" "14.10" "15.04" "15.10" "16.04" "16.10" "17.04" "17.10" "18.04" "18.10" "19.04" "19.10" "20.04" "20.10" "21.04" "21.10" "22.04" "22.10")
RELEASE_EOL=("2019-04-25" "2015-07-23" "2016-02-04" "2016-07-28" "2021-04-21" "2017-07-20" "2018-01-13" "2018-07-19" "2023-04-26" "2019-07-18" "2020-01-23" "2020-07-17" "2025-04-23" "2021-07-22" "2022-01-20" "2022-07-14" "2027-04-21" "2023-07-20")
SHELL=/bin/bash
CWD="$(pwd)"
WIP="${CWD}/isorespinner"
REMOVE_WIP=true
ISORESPINNER_LOGFILE="${CWD}/isorespinner.log"
FORCED_MESSAGE=false

trap 'FORCED_EXIT' SIGHUP SIGINT SIGTERM

function DISPLAY_WARNING {
	DISPLAY_TEXT="$1"
	echo "$(basename ${0}): WARNING: ${DISPLAY_TEXT}"
	if [ -f "${ISORESPINNER_LOGFILE}" ]; then
		echo "WARNING: ${DISPLAY_TEXT}" >> "${ISORESPINNER_LOGFILE}" 2> /dev/null
	fi
}

function DISPLAY_MESSAGE {
	DISPLAY_TEXT="$1"
	echo "$(basename ${0}): ${DISPLAY_TEXT}"
	if [ -f "${ISORESPINNER_LOGFILE}" ]; then
		echo "${DISPLAY_TEXT}" >> "${ISORESPINNER_LOGFILE}" 2> /dev/null
	fi
}

function DISPLAY_PROGRESS {
	DISPLAY_TEXT="$1"
	echo "$(basename ${0}): ${DISPLAY_TEXT}"
}

function UMOUNT {
	MOUNT_POINT=$1
	sudo umount -lf ${MOUNT_POINT} > /dev/null 2>&1
	if mountpoint -q ${MOUNT_POINT}; then
		sleep 10
	fi
	sudo umount -lf ${MOUNT_POINT} > /dev/null 2>&1
	if mountpoint -q ${MOUNT_POINT}; then DISPLAY_PROGRESS "$(basename ${0}): Cannot unmount '${MOUNT_POINT}'." && FORCED_EXIT; fi
}

function FORCED_EXIT {
	${FORCED_MESSAGE} && DISPLAY_MESSAGE "Exiting ... ISO not created."
	cd "${CWD}"
	if [ -d "${WIP}" ]; then
		cd "${WIP}"
		UMOUNT mnt
		UMOUNT iso-chroot/dev/pts
		UMOUNT iso-chroot/dev
		UMOUNT iso-chroot/sys
		UMOUNT iso-chroot/proc
		UMOUNT iso-chroot
		for LOOP_DEVICE in ${LOOP_SQUASH} ${LOOP_ISORESPINNER} ${LOOP_ISO}
		do
			UMOUNT ${LOOP_DEVICE}
			sudo losetup -d ${LOOP_DEVICE} > /dev/null 2>&1
		done
		cd "${CWD}"
		UMOUNT "${WIP}"
		${REMOVE_WIP} && sudo rm -rf "${WIP}"
	fi
	sudo rm -f "${CWD}"/.isorespinner.sh.lock
	exit -1
}

function DISPLAY_USAGE {
	echo "Usage: $(basename ${0}) [ -h | -v | --check ]"
	echo "       $(basename ${0}) -i <ISO> [ -w <directory> | -u | -k <kernel> | --dist-upgrade | --upgrade | --interactive | --all | --disk | --debug | ..."
	echo "       $(basename ${0}) ... -b [ GRUB-32 | GRUB-64 ] | -g [ \"\" | \"<kernel boot parameter> ... \" ] | c \"<cmd> ... \" | ..."
	echo "       $(basename ${0}) ... --key \"<repo> ... \" | -r \"<repo> ... \" | -p \"<pkg> ... \" | -l \"<pkg.deb> ... \" | -e \"<pkg> ... \" | -f [ \"<file> | <directory> ... \" ]"
}

function CHECK_WHETHER { for MATCHED_FLAG in "${@:2}"; do [[ "${1}" == "${MATCHED_FLAG}" ]] && return 0; done && return 1; }

function GET_LONG_FLAG { for VALUE in $(seq 0 $((${#LONG_FLAGS[@]}-1))); do [[ "${FLAG:1:1}" == "${LONG_FLAGS[${VALUE}]:0:1}" ]] && LONG_FLAG="--${LONG_FLAGS[${VALUE}]}" && return 0; done; LONG_FLAG="" && return 1; }

function PARSE_CMDLINE_OPTION {
	if [ -n "${README_FLAG}" ]; then
		case ${README_FLAG} in
			"--local-package"|"--file"|"--iso")
				for READLINK_README_ARGUMENT in ${README_ARGUMENT}
				do
					READLINK_README_ARGUMENT=${READLINK_README_ARGUMENT#\"}
					READLINK_README_ARGUMENT=${READLINK_README_ARGUMENT%\"}
					FULL_PATHNAME_README_ARGUMENT+=" $(readlink -f ${READLINK_README_ARGUMENT} 2> /dev/null)"
				done
				if [ "${README_ARGUMENT:0:1}" == '"' ]; then
					README_ARGUMENT='"'${FULL_PATHNAME_README_ARGUMENT:1}'"'
				else
					README_ARGUMENT=${FULL_PATHNAME_README_ARGUMENT:1}
				fi
				FULL_PATHNAME_README_ARGUMENT=""
				;;
		esac
		if [ "${README_FLAG}" != "--work-directory" ]; then
			README_ARGUMENT=${README_ARGUMENT%% }
			if [ -n "${README_ARGUMENT}" ]; then
				README_ARGUMENT=${README_ARGUMENT}
			elif [ "${README_FLAG}" == "--grub" ]; then
				README_ARGUMENT='""'
			fi
			README[${README_ARRAY}]="${README_FLAG} ${README_ARGUMENT}"
			((README_ARRAY++))
		fi
	fi
}

function CHECK_CMDLINE {
	ISORESPINNER_SCRIPT=$(readlink -f ${0})
	ISORESPINNER_COMMAND="$@"
	echo "Script '${0}' (version: ${VERSION}) called with '${ISORESPINNER_COMMAND}' ..." >> ${ISORESPINNER_LOGFILE}
	README[0]="$(basename ${0}) (version: ${VERSION})"
	README_ARRAY=1
	PARSE_ARGUMENT=false
	PART_OF_COMMENT=false
	if [ -f ${WIP} -o -d ${WIP} ]; then
		DISPLAY_MESSAGE "Work directory '$(basename ${WIP})' already exists."
		REMOVE_WIP=false
		FORCED_EXIT
	else
		sudo mkdir ${WIP} > /dev/null 2>&1
	fi
	for README_OPTION in "$@"
	do
		if ! ${PART_OF_COMMENT}; then
			if [ "${README_OPTION:0:1}" == "-" ]; then
				README_FLAG=${README_OPTION}
				if [ "${README_OPTION:0:2}" != "--" ]; then
					FLAG=${README_OPTION}
					GET_LONG_FLAG
					if [ -n "${LONG_FLAG}" ]; then
						README_FLAG=${LONG_FLAG}
					fi
				fi
				if (CHECK_WHETHER "${README_FLAG:2}" "${DOES_NOT_NEED_AN_ARGUMENT[@]}"); then
					README_ARGUMENT=""
					PARSE_CMDLINE_OPTION
					PARSE_ARGUMENT=false
					continue
				fi
				README_ARGUMENT=""
				PARSE_ARGUMENT=true
				continue
			fi
		fi
		if ${PARSE_ARGUMENT}; then
			if [ "${README_OPTION:0:1}" == '"' ]; then
				PART_OF_COMMENT=true
			fi
			if [ "${README_OPTION:$((${#README_OPTION}-1)):1}" == '"' ]; then
				PART_OF_COMMENT=false
			fi
			README_ARGUMENT+="${README_OPTION} "
			if ! ${PART_OF_COMMENT}; then
				PARSE_CMDLINE_OPTION
				PARSE_ARGUMENT=false
			fi
		fi
	done
	if ${PARSE_ARGUMENT}; then
		PARSE_CMDLINE_OPTION
	fi
	UPDATE_INITRAMFS=false
	UPDATE_INITRAMFS_ENVIRONMENT=""
	ALL_LAYERS=false
	INTERACTIVE=false
	DEBUG=false
	I_OPTION=false
	NEED_TO_FETCH_MAINLINE_DEBS=false
	UPDATE_KERNEL=false
	U_OPTION=false
	K_OPTION=false
	PURGE_PACKAGE=false
	APT_PURGE_OPTION="--autoremove"
	E_OPTION=false
	PURGE_ARRAY=0
	ADD_KEY=false
	KEY_OPTION=false
	KEY_ARG=false
	KEY_ARRAY=0
	ADD_REPOSITORY=false
	R_OPTION=false
	REPOSITORY_ARRAY=0
	ADD_PACKAGE=false
	P_OPTION=false
	PACKAGE_ARRAY=0
	ADD_LOCAL_PACKAGE=false
	L_OPTION=false
	LOCAL_PACKAGE_ARRAY=0
	DIST_UPGRADE=false
	UPGRADE=false
	UPGRADE_COMMAND=""
	ADD_FILE=false
	F_OPTION=false
	FILE_ARRAY=0
	ADD_COMMAND=false
	C_OPTION=false
	COMMAND_ARRAY=0
	B_OPTION=false
	BOOT="grub-64"
	ADD_KERNEL_BOOT_PARAMETER=false
	KERNEL_BOOT_PARAMETER=""
	DELETE_KERNEL_BOOT_PARAMETERS=false
	W_OPTION=false
	FLAG_FOUND=false
	ARGUMENT_FOUND=true
	MULTIPLE_ARGUMENTS=false;
	MULTIPLE=""
	EMBEDDED_QUOTE=false
	REQUIRED_SPACE=15 # minimum for RAM based non multi-layer filesystem although only 6 is required for RAM based multi-layer filesystem and disk will add gestimated respun ISO size
	DISK=false
	USING_MEMORY=false
	SYSTEMD_CHECKED=false
	for VALUE in $(seq 0 $((${#LONG_FLAGS[@]}-1)))
	do
		SHORT_FLAGS[${VALUE}]="${LONG_FLAGS[${VALUE}]:0:1}"
	done
	for EACH_OPTION_IN_CMDLINE in $(seq 1 $#)
	do
		OPTION=${@:${EACH_OPTION_IN_CMDLINE}:1}
		if [ -z "${OPTION}" ]; then
			echo "Blank"
			continue
		fi
		# flag
		if ! ${MULTIPLE_ARGUMENTS} && [ "${OPTION:0:1}" == '-' ]; then
			if ! ${ARGUMENT_FOUND}; then
				if [ -z "${LONG_FLAG}" ]; then
					GET_LONG_FLAG
				fi
				if [ "${LONG_FLAG}" == "--key" ]; then
					DISPLAY_MESSAGE "An argument must be specified when using '${LONG_FLAG}'."
				else
					DISPLAY_MESSAGE "An argument must be specified when using '${FLAG}' or '${LONG_FLAG}'."
				fi
				FORCED_EXIT
			elif [ "${OPTION:1:1}" == '-' ] ; then
				if (! CHECK_WHETHER "${OPTION:2}" "${LONG_FLAGS[@]}") ; then
					DISPLAY_MESSAGE "Invalid option '${OPTION}'."
					DISPLAY_USAGE
					rm -f ${ISORESPINNER_LOGFILE}
					FORCED_EXIT
				fi
				SHORT_FLAG="${OPTION:2:1}"
			else
				if (! CHECK_WHETHER "${OPTION:1}" "${SHORT_FLAGS[@]}"); then
					DISPLAY_MESSAGE "Invalid option '${OPTION}'."
					DISPLAY_USAGE
					rm -f ${ISORESPINNER_LOGFILE}
					FORCED_EXIT
				fi
				SHORT_FLAG="${OPTION:1}"
			fi
			FLAG="-${SHORT_FLAG}"
			LONG_FLAG=""
			FLAG_FOUND=true
			ARGUMENT_FOUND=false
			case "${SHORT_FLAG}" in
				"h")
					OPTION_HELP
					;;
				"v")
					OPTION_VERSION
					;;
				"c")	# cOMMAND or cHECK
					if [ "${OPTION}" != "-c" -a "${OPTION}" != "--command" ]; then
						OPTION_VERSION_CHECK
					else
						NEXT_OPTION_IN_CMDLINE=$((EACH_OPTION_IN_CMDLINE+1))
					fi
					;;
				"u")	# uPDATE or uPGRADE
					if [ "${OPTION}" == "--upgrade" ]; then
						LONG_FLAG="--upgrade"
						OPTION_UPGRADE
					else
						OPTION_UPDATE
					fi
					FLAG_FOUND=false
					ARGUMENT_FOUND=true
					;;
				"k")	# kERNEL or kEY
					if [ "${OPTION}" == "--key" ]; then
						LONG_FLAG="--key"
						KEY_OPTION=true
						KEY_ARG=true
					fi
					;;
				"d")	# dEBUG or dIST-UPGRADE or dISK
					if [ "${OPTION}" == "--debug" ]; then
						LONG_FLAG="--debug"
						DEBUG=true
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					elif [ "${OPTION}" == "--dist-upgrade" ]; then
						OPTION_DIST_UPGRADE
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					elif [ "${OPTION}" == "--disk" ]; then
						LONG_FLAG="--disk"
						DISK=true
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					fi
					;;
				"i")	# iNTERACTIVE
					if [ "${OPTION}" == "--interactive" ]; then
						LONG_FLAG="--interactive"
						INTERACTIVE=true
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					fi
					;;
				"a")	# all
					LONG_FLAG="--all"
					ALL_LAYERS=true
					FLAG_FOUND=false
					ARGUMENT_FOUND=true
					;;
				*)
					NEXT_OPTION_IN_CMDLINE=$((EACH_OPTION_IN_CMDLINE+1))
					;;
			esac
		# argument
		else
			if ! ${MULTIPLE_ARGUMENTS}; then
				# ""
				if [ "${#OPTION}" -eq 0 ] || [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' -a "${#OPTION}" -eq 2 ]; then
					if (CHECK_WHETHER "${SHORT_FLAG}" "${NEEDS_AN_ARGUMENT[@]}"); then
						# exception for '-g ""' which is valid
						if [ "${SHORT_FLAG}" == 'g' ]; then
							ARGUMENT_FOUND=true
						else
							ARGUMENT_FOUND=false
							break
						fi
					fi
				# "OPTION"
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					OPTION=${OPTION/#\"/ }
					OPTION=${OPTION/%\"/ }
					ARGUMENT_FOUND=true
				# "OPTION ...
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" != '"' ]; then
					MULTIPLE_ARGUMENTS=true;
					MULTIPLE=${OPTION:1:${#OPTION}}
				else
					ARGUMENT_FOUND=true
				fi
			else
				# ... "OPTION" ...
				if [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION}"
				# ... "OPTION ...
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" != '"' ]; then
					EMBEDDED_QUOTE=true
					MULTIPLE+=" ${OPTION}"
				# ... OPTION" ...
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					EMBEDDED_QUOTE=false
					MULTIPLE+=" ${OPTION}"
				# ... OPTION"
				elif ! ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... OPTION""
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					EMBEDDED_QUOTE=false
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... "OPTION"""
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					EMBEDDED_QUOTE=false
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... "OPTION""
				elif ! ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... OPTION ...
				else
					MULTIPLE+=" ${OPTION}"
				fi
			fi
			if ! ${MULTIPLE_ARGUMENTS}; then
				if ! ${FLAG_FOUND} || ! (CHECK_WHETHER "${SHORT_FLAG}" "${NEEDS_AN_ARGUMENT[@]}"); then
					DISPLAY_MESSAGE "Option not specified for '${OPTION}'."
					FORCED_EXIT
				fi
				case "${FLAG}" in
					"-k")
						if ${KEY_ARG}; then
							LONG_FLAG="key"
							KEYS[${KEY_ARRAY}]="${OPTION}"
							((KEY_ARRAY++))
							KEY_ARG=false
						else
							LONG_FLAG="kernel"
							MAINLINE_BRANCH="${OPTION}"
							OPTION_KERNEL
						fi
						;;
					"-r")
						LONG_FLAG="repository"
						REPOSITORIES[${REPOSITORY_ARRAY}]="${OPTION}"
						((REPOSITORY_ARRAY++))
						R_OPTION=true
						;;
					"-e")
						LONG_FLAG="erase"
						PURGE_PACKAGES[${PURGE_ARRAY}]="${OPTION}"
						((PURGE_ARRAY++))
						E_OPTION=true
						;;
					"-p")
						LONG_FLAG="package"
						PACKAGES[${PACKAGE_ARRAY}]="${OPTION}"
						((PACKAGE_ARRAY++))
						P_OPTION=true
						;;
					"-l")
						LONG_FLAG="local-package"
						LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]="${OPTION}"
						((LOCAL_PACKAGE_ARRAY++))
						L_OPTION=true
						;;
					"-f")
						LONG_FLAG="file"
						FILES[${FILE_ARRAY}]="${OPTION}"
						((FILE_ARRAY++))
						F_OPTION=true
						;;
					"-b")
						LONG_FLAG="boot"
						BOOT="${OPTION}"
						OPTION_BOOT
						;;
					"-i")
						LONG_FLAG="iso"
						ISO="${OPTION}"
						OPTION_ISO
						;;
					"-w")
						LONG_FLAG="work-directory"
						WORK_DIRECTORY="${OPTION}"
						OPTION_WORK
						;;
					"-c")
						LONG_FLAG="command"
						COMMANDS[${COMMAND_ARRAY}]="${OPTION}"
						((COMMAND_ARRAY++))
						C_OPTION=true
						;;
					"-g")
						LONG_FLAG="grub"
						if [ "${OPTION:0:1}" == " " ]; then
							OPTION="${OPTION# }"
						fi
						if [ "${OPTION: -1}" == " " ]; then
							OPTION="${OPTION% }"
						fi
						if [ -z "${OPTION}" -o "${OPTION}" == '""' ]; then
							DELETE_KERNEL_BOOT_PARAMETERS=true
						else
							ADD_KERNEL_BOOT_PARAMETER=true
							KERNEL_BOOT_PARAMETER="${KERNEL_BOOT_PARAMETER} ${OPTION}"
						fi
						;;
					*)
						DISPLAY_MESSAGE "Unknown option '${FLAG}'."
						FORCED_EXIT
						;;
				esac
				FLAG_FOUND=false
			fi
		fi
	done
	if ! ${ARGUMENT_FOUND}; then
		if [ -z "${LONG_FLAG}" ]; then
			GET_LONG_FLAG
		fi
		if [ "${LONG_FLAG}" == "--key" ]; then
			DISPLAY_MESSAGE "An argument must be specified when using '${LONG_FLAG}'."
		else
			DISPLAY_MESSAGE "An argument must be specified when using '${FLAG}' or '${LONG_FLAG}'."
		fi
		FORCED_EXIT
	fi
	if [ -z "${ISO}" ]; then
		DISPLAY_MESSAGE "An ISO must be specified using '-i' or '--iso' option."
		FORCED_EXIT
	fi
}

function PROCESS_CMDLINE {
	${W_OPTION} && \
		echo "Work directory '${WORK_DIRECTORY}/isorespinner' used ..." >> ${ISORESPINNER_LOGFILE} \
		|| (${USING_MEMORY} && \
		echo "$(basename ${0}): Running in RAM ..." && \
		echo "RAM work directory '$(basename ${WIP})' used ..." >> ${ISORESPINNER_LOGFILE} \
		||	echo "Work directory '$(basename ${WIP})' used ..." >> ${ISORESPINNER_LOGFILE})
	${C_OPTION} && PROCESS_C_OPTION
	${F_OPTION} && PROCESS_F_OPTION
	${L_OPTION} && PROCESS_L_OPTION
	${R_OPTION} && PROCESS_R_OPTION
	${KEY_OPTION} && PROCESS_KEY_OPTION
	${E_OPTION} && PROCESS_E_OPTION
	${P_OPTION} && PROCESS_P_OPTION
	${U_OPTION} && PROCESS_U_OPTION
	${K_OPTION} && PROCESS_K_OPTION
	if ${UPDATE_KERNEL}; then
		NEED_TO_FETCH_MAINLINE_DEBS=true
		LINUXIUM_ISO="linuxium-${MAINLINE_BRANCH}-$(basename ${ISO})"
	else
		LINUXIUM_ISO="linuxium-$(basename ${ISO})"
	fi
	if [ -z "${WORK_DIRECTORY}" -a -f ${LINUXIUM_ISO} ]; then
		DISPLAY_MESSAGE "Respun ISO '${LINUXIUM_ISO}' already exists."
		FORCED_EXIT
	elif [ -f ${WORK_DIRECTORY}/${LINUXIUM_ISO} ]; then
		DISPLAY_MESSAGE "Respun ISO '${WORK_DIRECTORY}/${LINUXIUM_ISO}' already exists."
		FORCED_EXIT
	fi
	if ${ADD_KERNEL_BOOT_PARAMETER}; then
		KERNEL_BOOT_PARAMETER="${KERNEL_BOOT_PARAMETER:1}"
	fi
	if [ "${BOOT}" == "grub-32" ]; then
		GRUB_32=true
	else
		GRUB_32=false
	fi
}

function CHECK_FOR_EXCLUSIVITY {
	if [ -f .isorespinner.sh.lock ]; then
		echo "$(basename ${0}): Lock file exists ... wait for running instance of isorespinner.sh to complete or remove '.isorespinner.sh.lock' and restart."
		exit -1
	else
		sudo touch .isorespinner.sh.lock
		export LC_ALL=C
		if [[ "${CWD}" =~ " " ]]; then
			echo "$(basename ${0}): Current directory '${CWD}' must not include a space in the name."
			FORCED_EXIT
		fi
		if [ -d ${ISORESPINNER_LOGFILE} ]; then
			echo "$(basename ${0}): Directory '$(basename ${ISORESPINNER_LOGFILE})' already exists ... cannot create logfile."
			FORCED_EXIT
		fi
		sudo rm -f ${ISORESPINNER_LOGFILE}
		if ! $(touch ${ISORESPINNER_LOGFILE} > /dev/null 2>&1); then
			echo "$(basename ${0}): Cannot create logfile '$(basename ${ISORESPINNER_LOGFILE})'."
			FORCED_EXIT
		fi
	fi
}

function CHECK_PACKAGE_DEPENDENCIES {
	[ "$(uname -m)" != "x86_64" ] && echo "$(basename ${0}): This script can only be run on a 64-bit (amd64 or x86_64) OS." && exit
	[ ! $(sudo bash -c "command -v bc") ] && echo "$(basename ${0}): Please ensure package 'bc' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v losetup") ] && echo "$(basename ${0}): Please ensure package 'klibc-utils' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v ip") ] && echo "$(basename ${0}): Please ensure package 'iproute2' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v isoinfo") ] && echo "$(basename ${0}): Please ensure package 'genisoimage' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v mkdosfs") ] && echo "$(basename ${0}): Please ensure package 'dosfstools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v mksquashfs") ] && echo "$(basename ${0}): Please ensure package 'squashfs-tools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v rsync") ] && echo "$(basename ${0}): Please ensure package 'rsync' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v unsquashfs") ] && echo "$(basename ${0}): Please ensure package 'squashfs-tools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v unzip") ] && echo "$(basename ${0}): Please ensure package 'unzip' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v wget") ] && echo "$(basename ${0}): Please ensure package 'wget' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v xargs") ] && echo "$(basename ${0}): Please ensure package 'findutils' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v xorriso") ] && echo "$(basename ${0}): Please ensure package 'xorriso' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v script") ] && echo "$(basename ${0}): Please ensure package 'bsdutils' or equivalent for your distro is installed." && exit
	# backward compatibility
	# [ ! $(sudo bash -c "command -v 7z") ] && echo "$(basename ${0}): Please ensure package 'p7zip-full' or equivalent for your distro is installed." && exit
	# [ ! $(sudo bash -c "command -v lz4") ] && echo "$(basename ${0}): Please ensure package 'liblz4-tool' or equivalent for your distro is installed." && exit
	# [ ! $(sudo bash -c "command -v zstd") ] && echo "$(basename ${0}): Please ensure package 'zstd' or equivalent for your distro is installed." && exit
}

function CHECK_FOR_SPACE {
	FREE_MEMORY=$(echo $(grep MemFree /proc/meminfo | awk '{print $2}') / 1024 / 1024 | bc -l)
	ROUNDED_FREE_MEMORY=$(printf "%.0f\n" ${FREE_MEMORY})
	DISPLAY_FREE_MEMORY=$(printf "%.1f\n" ${FREE_MEMORY})
	# assume up to 10% increase after respinning
	POTENTIAL_SIZE_OF_RESPUN_ISO=$(stat --format="%s*1.1/1024/1024/1024+0.5" ${ISO} | bc -l)
	ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO=$(printf "%.0f\n" ${POTENTIAL_SIZE_OF_RESPUN_ISO})
	REQUIRED_DISK_SPACE=$(echo $((${REQUIRED_SPACE}+${ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO})))
	if ${DISK} || [ ${ROUNDED_FREE_MEMORY} -lt "${REQUIRED_SPACE}" ]; then
		! ${DISK} && DISPLAY_WARNING "Insufficient memory (only ${DISPLAY_FREE_MEMORY}GB free compared to required minimum of ${REQUIRED_SPACE}GB) so checking disk space availability ..."
		FREE_SPACE=$(stat -f --format="%a*%S/1024/1024/1024" ${WIP} | bc -l)
		ROUNDED_FREE_SPACE=$(printf "%.0f\n" ${FREE_SPACE})
		DISPLAY_FREE_SPACE=$(printf "%.1f\n" ${FREE_SPACE})
		if [ "${ROUNDED_FREE_SPACE}" -lt ${REQUIRED_DISK_SPACE} ]; then
			DISPLAY_MESSAGE "Insufficient disk space ... there is only ${DISPLAY_FREE_SPACE}GB free and at least ${REQUIRED_DISK_SPACE}GB will be required."
			FORCED_EXIT
		fi
	else
		FREE_SPACE=$(stat -f --format="%a*%S/1024/1024/1024" ${WIP} | bc -l)
		ROUNDED_FREE_SPACE=$(printf "%.0f\n" ${FREE_SPACE})
		DISPLAY_FREE_SPACE=$(printf "%.1f\n" ${FREE_SPACE})
		if [ "${ROUNDED_FREE_SPACE}" -lt ${ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO} ]; then
			DISPLAY_MESSAGE "Insufficient disk space ... there is only ${DISPLAY_FREE_SPACE}GB free and at least ${ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO}GB will be required."
			FORCED_EXIT
		fi
		sudo mount -t tmpfs -o size=${REQUIRED_SPACE}G tmpfs ${WIP}
		USING_MEMORY=true
	fi
}

function CHECK_USED_MEMORY {
	FINAL_FREE_MEMORY=$(echo $(grep MemFree /proc/meminfo | awk '{print $2}') / 1024 / 1024 | bc -l)
	ROUNDED_FINAL_FREE_MEMORY=$(printf "%.0f\n" ${FINAL_FREE_MEMORY})
	USED_FREE_MEMORY=$(echo ${ROUNDED_FREE_MEMORY} - ${ROUNDED_FINAL_FREE_MEMORY} | bc)
	if [ ${USED_FREE_MEMORY} -gt ${REQUIRED_SPACE} ]; then
		echo "$(basename ${0}): As a result of running in RAM the 'free' memory is now low with only ${ROUNDED_FINAL_FREE_MEMORY}GB available."
		echo "$(basename ${0}): Run 'sudo sysctl -w vm.drop_caches=3' to release the buffers/cached memory."
	elif [ ${USED_FREE_MEMORY} -lt 0 ]; then
		echo "$(basename ${0}): After running in RAM ${USED_FREE_MEMORY}GB of buffers/cached memory was released and now ${ROUNDED_FINAL_FREE_MEMORY}GB is available."
	else
		echo "$(basename ${0}): As a result of running in RAM ${USED_FREE_MEMORY}GB of buffers/cached memory was used leaving ${ROUNDED_FINAL_FREE_MEMORY}GB available."
	fi
}

