		FORCED_EXIT
	fi
	NEW_VERSION="$(sudo wget -qO- "https://drive.google.com/uc?export=download&id=$(sudo wget -qO- http://url.linuxium.com.au/isorespinner_sh_version | grep continue=https://drive.google.com | sed 's?.*continue=https://drive.google.com/file/d/??' | sed 's?/edit.*??')")"
	if [ -z "${NEW_VERSION}" ]; then
