function PROCESS_C_OPTION {
	ADD_COMMAND=true
}

function SUPPORTED { for OS in "${@:2}"; do [[ "${OS}" == "${ISO_DISTRO}" ]] && return 0; done && return 1; }

function OPTION_ISO {
	if ${I_OPTION}; then
		DISPLAY_MESSAGE "ISO already specified using '-i' or '--iso' option."
		FORCED_EXIT
	fi
	if [ -z "${ISO}" ]; then
		DISPLAY_MESSAGE "An ISO must be specified using '-i' or '--iso' option."
		DISPLAY_USAGE
		FORCED_EXIT
	fi
	if [ ! -f "${ISO}" ]; then
		DISPLAY_MESSAGE "Cannot find ISO '${ISO}'."
		FORCED_EXIT
	fi
	ISO=$(readlink -f ${ISO})
	ISO_VOLID=$(isoinfo -d -i ${ISO} 2> /dev/null | grep '^Volume id:') && ISO_VOLID=${ISO_VOLID##Volume id: }
	DISTRO_POINT_RELEASE=$(echo ${ISO_VOLID} | awk '{print $2'})
	ISO_DISTRO=${ISO_VOLID%% *}
	[ "${ISO_DISTRO}" == "Linux" ] && ISO_DISTRO=${ISO_VOLID#Linux } && ISO_DISTRO=${ISO_DISTRO%% *}
	if ( ! SUPPORTED "${ISO_DISTRO}" "${SUPPORTED_OS[@]}" ); then
		DISPLAY_MESSAGE "'$(basename ${ISO})' must be an Ubuntu, Ubuntu Unity, Kubuntu, Lubuntu, Ubuntu Budgie, Ubuntu GNOME, Ubuntu MATE, Xubuntu or Linux Mint desktop ISO."
		FORCED_EXIT
	fi
	DISTRO_PACKAGES="Packages.gz"
	ZIP_COMMAND="gzip"
	PRESEED_SEED="${ISO_DISTRO,,}.seed"
	case "${ISO_DISTRO}" in
		"Ubuntu"|"Ubuntu-Unity"|"Kubuntu"|"Lubuntu"|"Ubuntu-Budgie"|"Ubuntu-GNOME"|"Ubuntu-MATE"|"Xubuntu")
			KERNEL_TYPE="generic"
			;;
		"Mint")
			KERNEL_TYPE="generic"
			PRESEED_SEED="linuxmint.seed"
			;;
		*)
			DISPLAY_MESSAGE "'${ISO_DISTRO}' unknown."
			FORCED_EXIT
			;;
	esac
	ISO_SQUASHFS_DIRECTORY=casper
	FILESYSTEM_FILES=manifest
	I_OPTION=true
}

function OPTION_WORK {
	if ${W_OPTION}; then
		DISPLAY_MESSAGE "Work directory already specified using '-w' or '--work-directory' option."
		FORCED_EXIT
	fi
 	WORK_DIRECTORY="${WORK_DIRECTORY## }"
 	WORK_DIRECTORY="${WORK_DIRECTORY%% }"
	if [[ "${WORK_DIRECTORY}" =~ " " ]]; then
		DISPLAY_MESSAGE "Work directory '${WORK_DIRECTORY}' must not include a space in the name."
		FORCED_EXIT
	fi
	if [ ! -d ${WORK_DIRECTORY} ]; then
		DISPLAY_MESSAGE "Cannot find work directory '${WORK_DIRECTORY}'."
		FORCED_EXIT
	fi
	sudo rm -rf ${WIP}
	WIP=$(readlink -f ${WORK_DIRECTORY}/isorespinner)
	if [ -f ${WIP} -o -d ${WIP} ]; then
		DISPLAY_MESSAGE "Work directory '${WORK_DIRECTORY}/isorespinner' already exists."
		REMOVE_WIP=false
		FORCED_EXIT
	else
		sudo mkdir ${WIP} > /dev/null 2>&1
	fi
	FREE_SPACE=$(stat -f --format="%a*%S/1024/1024/1024" ${WIP} | bc -l)
	ROUNDED_FREE_SPACE=$(printf "%.0f\n" ${FREE_SPACE})
	DISPLAY_FREE_SPACE=$(printf "%.1f\n" ${FREE_SPACE})
	# assume up to 10% increase after respinning
	POTENTIAL_SIZE_OF_RESPUN_ISO=$(stat --format="%s*1.1/1024/1024/1024+0.5" ${ISO} | bc -l)
	ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO=$(printf "%.0f\n" ${POTENTIAL_SIZE_OF_RESPUN_ISO})
	REQUIRED_DISK_SPACE=$(echo $((${REQUIRED_SPACE}+${ROUNDED_POTENTIAL_SIZE_OF_RESPUN_ISO})))
	if [ "${ROUNDED_FREE_SPACE}" -lt ${REQUIRED_DISK_SPACE} ]; then
		DISPLAY_MESSAGE "Insufficient disk space ... there is only ${DISPLAY_FREE_SPACE}GB free and at least ${REQUIRED_DISK_SPACE}GB will be required."
		FORCED_EXIT
	fi
	W_OPTION=true
}

function GET_RELEASE_EOL { for NUMBER in $(seq 0 $((${#RELEASE_VERSION[@]}-1))); do [[ "${1}" == "${RELEASE_VERSION[${NUMBER}]}" ]] && DISTRO_EOL="${RELEASE_EOL[${NUMBER}]}" && return 0; done; DISTRO_EOL="" && return 1; }

function CODENAME_TO_RELEASE { for NAME in $(seq 0 $((${#RELEASE_CODENAME[@]}-1))); do [[ "${1}" == "${RELEASE_CODENAME[${NAME}]}" ]] && DISTRO_RELEASE="${RELEASE_VERSION[${NAME}]}" && return 0; done; DISTRO_RELEASE="" && return 1; }

function EXTRACT_ISO_DIRECTORY_STRUCTURE {
	DISPLAY_PROGRESS "Extracting ISO ..."
	cd ${WIP}
	# mount iso
	sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
	sudo losetup -f > /dev/null 2>&1 || FORCED_EXIT
	LOOP_ISO=$(sudo losetup -f)
	sudo losetup ${LOOP_ISO} ${ISO}
	sudo mkdir iso
	sudo mount ${LOOP_ISO} iso 2> /dev/null
	SUCCESSFULLY_MOUNTED=$?
	if [ ${SUCCESSFULLY_MOUNTED} != 0 ]; then
		DISPLAY_MESSAGE "Cannot mount ISO '${ISO}'."
		FORCED_EXIT
	# include specific exception for Ubuntu-Unity ISO
	elif [ ! -d iso/.disk -o ! -d iso/${ISO_SQUASHFS_DIRECTORY} -o ! iso/EFI -o ! -d iso/boot/grub -o ! -d iso/dists -o ! -d iso/pool -o \( ! -d iso/preseed -a "${ISO_DISTRO}" != "Ubuntu-Unity" \) ]; then
		DISPLAY_MESSAGE "ISO structure not compatible with an Ubuntu, Ubuntu Unity, Kubuntu, Lubuntu, Ubuntu Budgie, Ubuntu GNOME, Ubuntu MATE, Xubuntu or Linux Mint desktop ISO."
		FORCED_EXIT
	elif ! $(sudo grep -sqm1 amd64 iso/.disk/info); then
		DISPLAY_MESSAGE "ISO '${ISO}' is not a 64-bit (amd64 or x86_64) ISO."
		FORCED_EXIT
	elif [ ! -f iso/${ISO_SQUASHFS_DIRECTORY}/filesystem.squashfs -a ! -f iso/${ISO_SQUASHFS_DIRECTORY}/$(sed -n '/^menuentry ".*Ubuntu" {/,/^}/p' iso/boot/grub/grub.cfg | grep layerfs-path= | sed 's/.*layerfs-path=\([^ ]*\).*/\1/') ]; then
		DISPLAY_MESSAGE "ISO '${ISO}' does not contain a 'squashfs' file system."
		FORCED_EXIT
	fi
	# extract iso directory structure from iso
	sudo rm -rf iso-directory-structure
	sudo rm -f .rsync.log
	sudo rsync -a iso/ iso-directory-structure 2> /dev/null | sudo tee .rsync.log > /dev/null
	if [ -s .rsync.log ]; then
		DISPLAY_MESSAGE "The following issues were encountered: "
		sudo cat .rsync.log | tee -a ${ISORESPINNER_LOGFILE}
		FORCED_EXIT
	fi
	sudo rm -f .rsync.log
	DISTRO_CODENAME=$(basename "$(find ${WIP}/iso-directory-structure/dists -maxdepth 1 -type d 2> /dev/null | sed 1d)")
	if [ -z "${DISTRO_CODENAME}" ]; then
		DISPLAY_MESSAGE "Cannot determine distro codename."
		FORCED_EXIT
	fi
	CODENAME_TO_RELEASE ${DISTRO_CODENAME} # returns DISTRO_RELEASE
	if GET_RELEASE_EOL ${DISTRO_RELEASE}; then
		if [[ $((($(date -d "${DISTRO_EOL}" +%s)-$(date +%s))/60/60/24)) -lt 0 ]]; then
			DISPLAY_MESSAGE "ISO is EOL."
			FORCED_EXIT
		fi
	else
		DISPLAY_MESSAGE "Cannot determine EOL for ISO."
		FORCED_EXIT
	fi
	# new package requirement for respinning 20.04 ISOs and up
	if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" ]; then
		[ ! $(sudo bash -c "command -v zstd") ] && echo "$(basename ${0}): Please ensure package 'zstd' or equivalent for your distro is installed." && FORCED_EXIT
		CPIO_COMPRESSION="zstd"
		UPDATE_INITRAMFS_ENVIRONMENT="CASPER_GENERATE_UUID=1"
	elif [ "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" -o "${DISTRO_RELEASE}" == "20.04" ]; then
		[ ! $(sudo bash -c "command -v lz4") ] && echo "$(basename ${0}): Please ensure package 'liblz4-tool' or equivalent for your distro is installed." && FORCED_EXIT
		CPIO_COMPRESSION="lz4"
		UPDATE_INITRAMFS_ENVIRONMENT="CASPER_GENERATE_UUID=1"
	fi
	ISO_VMLINUZ=$(find iso-directory-structure/${ISO_SQUASHFS_DIRECTORY} -maxdepth 1 -name vmlinuz* -type f)
	if [ -n "${ISO_VMLINUZ}" ]; then
		ISO_VMLINUZ=$(basename $(ls -t ${ISO_VMLINUZ} | head -1))
	else
		DISPLAY_MESSAGE "Cannot find ISO kernel."
		FORCED_EXIT
	fi
	ISO_INITRD=$(find iso-directory-structure/${ISO_SQUASHFS_DIRECTORY} -maxdepth 1 -name initrd* -type f)
	if [ -n "${ISO_INITRD}" ]; then
		ISO_INITRD=$(basename $(ls -t ${ISO_INITRD} | head -1))
	else
		DISPLAY_MESSAGE "Cannot find ISO initramfs."
		FORCED_EXIT
	fi
	sudo cp iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} pre-filesystem.${FILESYSTEM_FILES}
	if [ "${DISTRO_RELEASE}" == "23.04" ]; then
		DISPLAY_MESSAGE "Support for 23.04 ISOs currently under development."
		FORCED_EXIT
	fi
	if [ "${DISTRO_RELEASE}" == "22.10" ]; then
		DISPLAY_WARNING "Support for 22.10 ISOs is still experimental ..."
	fi
	echo "ISO '${ISO}' respun ..." >> ${ISORESPINNER_LOGFILE}
}

function CREATE_AND_MOUNT_ISORESPINNER_PARTITION {
	cd ${WIP}
	ISORESPINNER_PARTITION=isorespins-${1,,}
	ISORESPINNER_FILESYSTEM=${ISORESPINNER_PARTITION}.ext4
	sudo rm -rf ${ISORESPINNER_PARTITION} ${ISORESPINNER_FILESYSTEM}
	sudo truncate -s 5G ${ISORESPINNER_FILESYSTEM}
	COMMAND_SUCCESSFUL=$?
	if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
		DISPLAY_MESSAGE "Cannot create isorespinner filesystem '${ISORESPINNER_FILESYSTEM}'."
		FORCED_EXIT
	fi
	sudo mkfs.ext4 ${ISORESPINNER_FILESYSTEM} -L ${ISORESPINNER_PARTITION} > /dev/null 2>&1
	COMMAND_SUCCESSFUL=$?
	if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
		DISPLAY_MESSAGE "Cannot make isorespinner filesystem '${ISORESPINNER_FILESYSTEM}'."
		FORCED_EXIT
	fi
	sudo mkdir ${ISORESPINNER_PARTITION}
	MOUNT_ISORESPINNER_PARTITION
	sudo rm -rf ${ISORESPINNER_PARTITION}/lost+found
	sudo mkdir ${ISORESPINNER_PARTITION}/upper ${ISORESPINNER_PARTITION}/work
}

function MOUNT_ISORESPINNER_PARTITION {
	cd ${WIP}
	sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
	sudo losetup -f > /dev/null 2>&1 || FORCED_EXIT
	LOOP_ISORESPINNER=$(sudo losetup -f)
	sudo losetup ${LOOP_ISORESPINNER} ${ISORESPINNER_FILESYSTEM}
	sudo mount ${LOOP_ISORESPINNER} ${ISORESPINNER_PARTITION} 2> /dev/null
	COMMAND_SUCCESSFUL=$?
	if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
		DISPLAY_MESSAGE "Can not mount ${LOOP_ISORESPINNER} on ${ISORESPINNER_PARTITION}"
		FORCED_EXIT
	fi
}

function MOUNT_SQUASHFS {
	cd ${WIP}
	MOUNTED_SQUASHFS=""
	MULTI_LAYER_FILESYSTEM=false
	LOOP_SQUASH=""
	# the following code c/o scripts/casper
	LAYERFS_PATH=$(sed -n '/^menuentry ".*Ubuntu" {/,/^}/p' iso/boot/grub/grub.cfg | grep layerfs-path= | sed 's/.*layerfs-path=\([^ ]*\).*/\1/')
	if [ -n "${LAYERFS_PATH}" ]; then
		# multi-layer filesystem
		MULTI_LAYER_FILESYSTEM=true
		NOT_DISPLAYED=true
		LAYERFS_PATH="iso/${ISO_SQUASHFS_DIRECTORY}/${LAYERFS_PATH}"
		LAYER_DIR=${LAYERFS_PATH%/*}
		LAYER_NAME=$(basename ${LAYERFS_PATH%.*})
		LAYER_EXT=${LAYERFS_PATH##*.}
		if [ "${LAYER_EXT}" != "squashfs" ]; then
			DISPLAY_MESSAGE "Only 'squashfs' file systemis supported."
			FORCED_EXIT
		fi
		LAYER_ERR=""
		LAYERS=""
		# compute list of depending layers
		while :; do
			LAYER_CUR="${LAYER_DIR}/${LAYER_NAME}.${LAYER_EXT}"
			if [ ! -f "${LAYER_CUR}" ]; then
				LAYER_ERR="${LAYER_ERR} '${LAYER_CUR}'"
			fi
			LAYERS="${LAYER_DIR}/${LAYER_NAME} ${LAYERS}"
			PARENT_LAYER_NAME=${LAYER_NAME%.*}
			if [ "${PARENT_LAYER_NAME}" = "${LAYER_NAME}" ]; then
				break
			fi
			LAYER_NAME=${PARENT_LAYER_NAME}
		done
		# exit with error if a layer is missing
		if [ -n "${LAYER_ERR}" ]; then
			DISPLAY_MESSAGE "File system layers are missing:${LAYER_ERR})"
			FORCED_EXIT
		fi
		LAYERS="${LAYERS% }"
		for IMAGE in ${LAYERS}; do
			IMAGE="${IMAGE}.${LAYER_EXT}"
			IMAGENAME=$(basename "${IMAGE}")
			sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
			sudo losetup -f > /dev/null 2>&1 || FORCED_EXIT
			LOOP_DEVICE=$(sudo losetup -f)
			LOOP_SQUASH="${LOOP_SQUASH} ${LOOP_DEVICE}"
			sudo losetup ${LOOP_DEVICE} "${IMAGE}"
			FSTYPE=$(sudo blkid -s TYPE -o value ${LOOP_DEVICE} 2>/dev/null)
			if [ "${FSTYPE}" != "squashfs" ]; then
				DISPLAY_MESSAGE "Unknown file system type for '${IMAGENAME}'."
				FORCED_EXIT
			fi
			sudo mkdir -p "${IMAGENAME}"
			sudo mount -t "${FSTYPE}" -o ro,noatime "${LOOP_DEVICE}" "${IMAGENAME}" 2> /dev/null
			COMMAND_SUCCESSFUL=$?
			if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
				DISPLAY_MESSAGE "Can not mount ${LOOP_DEVICE} on ${IMAGENAME}"
				FORCED_EXIT
			fi
			MOUNTED_SQUASHFS="${IMAGENAME} ${MOUNTED_SQUASHFS}"
		done
		MOUNTABLE_SQUASHFS_FOR_LIVE="${MOUNTED_SQUASHFS% }"
		LANGUAGE_CODE=${LANG%%_*}
		if [ -z "${LANGUAGE_CODE}" -o "${LANGUAGE_CODE}" == "C.UTF-8" ]; then
			LANGUAGE_CODE=en
		fi
		if ${ALL_LAYERS}; then
			if ${INTERACTIVE}; then
				DISPLAY_MESSAGE "ISO uses multi-layer filesystems but using '--interactive' to process '--all' layers is not supported."
				FORCED_EXIT
			fi
			SQUASHFS_LANGUAGE_CODES=$(ls -C1 iso/${ISO_SQUASHFS_DIRECTORY}/minimal\.??[\.-]*squashfs | sed 's/[^\.]*.\([^\.]*\)*.*/\1/' | xargs)
			DISPLAY_PROGRESS "ISO uses multi-layer filesystems so processing all '${SQUASHFS_LANGUAGE_CODES}' language and 'live' layers ..."
			echo "All multi-layer '${SQUASHFS_LANGUAGE_CODES}' language and 'live' filesystems layers processed ..." >> ${ISORESPINNER_LOGFILE} 2> /dev/null
		else
			if ! [[ $(ls iso/${ISO_SQUASHFS_DIRECTORY}/*\.??\.* | sed -n 's/.*\.\(..\)\..*/\1/p' | sort --u) =~ (^|[[:space:]])${LANGUAGE_CODE}($|[[:space:]]) ]]; then
				DISPLAY_MESSAGE "ISO uses multi-layer filesystems but does not include '${LANGUAGE_CODE}' language support."
				FORCED_EXIT
			fi
			SQUASHFS_LANGUAGE_CODES=${LANGUAGE_CODE}
			DISPLAY_PROGRESS "ISO uses multi-layer filesystems but processing only '${SQUASHFS_LANGUAGE_CODES}' language and 'live' layers ..."
			echo "Only multi-layer '${SQUASHFS_LANGUAGE_CODES}' language and 'live' filesystems layers processed ..." >> ${ISORESPINNER_LOGFILE} 2> /dev/null
		fi
		SQUASHFS_TYPE=""
		SQUASHFS_FOR_LIVE=${MOUNTABLE_SQUASHFS_FOR_LIVE%% *}
		for LANGUAGE_CODE in ${SQUASHFS_LANGUAGE_CODES}
		do 
			LAYER_NAME=${LANGUAGE_CODE^^}
			LAYER_NAME=${LAYER_NAME/-/_}
			SQUASHFS_TYPE="${LAYER_NAME} ${SQUASHFS_TYPE}"
			declare -g SQUASHFS_FOR_${LAYER_NAME}="${SQUASHFS_FOR_LIVE/%.live.${LAYER_EXT}/.${LANGUAGE_CODE}.${LAYER_EXT}}"
			SQUASHFS_FOR_LAYER=SQUASHFS_FOR_${LAYER_NAME}
			IMAGE="iso/${ISO_SQUASHFS_DIRECTORY}/${!SQUASHFS_FOR_LAYER}"
			if ! [ -f "${IMAGE}" ]; then
				DISPLAY_MESSAGE "Cannot locate squashfs file '${!SQUASHFS_FOR_LAYER}'"
				FORCED_EXIT
			fi
			declare -g MOUNTABLE_SQUASHFS_FOR_${LAYER_NAME}="${MOUNTABLE_SQUASHFS_FOR_LIVE/${SQUASHFS_FOR_LIVE}/${!SQUASHFS_FOR_LAYER}}"
			MOUNTABLE_SQUASHFS_FOR_LAYER=MOUNTABLE_SQUASHFS_FOR_${LAYER_NAME}
			sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
			sudo losetup -f > /dev/null 2>&1 || FORCED_EXIT
			LOOP_DEVICE=$(sudo losetup -f)
			LOOP_SQUASH="${LOOP_SQUASH} ${LOOP_DEVICE}"
			sudo losetup ${LOOP_DEVICE} "${IMAGE}"
			FSTYPE=$(sudo blkid -s TYPE -o value ${LOOP_DEVICE} 2>/dev/null)
			if [ "${FSTYPE}" != "squashfs" ]; then
				DISPLAY_MESSAGE "Unknown file system type for '${!SQUASHFS_FOR_LAYER}'."
				FORCED_EXIT
			fi
			sudo mkdir -p "${!SQUASHFS_FOR_LAYER}"
			sudo mount -t "${FSTYPE}" -o ro,noatime "${LOOP_DEVICE}" "${!SQUASHFS_FOR_LAYER}" 2> /dev/null
			COMMAND_SUCCESSFUL=$?
			if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
				DISPLAY_MESSAGE "Can not mount ${LOOP_DEVICE} on ${!SQUASHFS_FOR_LAYER}"
				FORCED_EXIT
			fi
			MOUNTED_SQUASHFS="${!SQUASHFS_FOR_LAYER} ${MOUNTED_SQUASHFS}"
			MOUNTED_SQUASHFS="${MOUNTED_SQUASHFS% }"
		done
		SQUASHFS_TYPE="${SQUASHFS_TYPE}LIVE"
	else
		# non multi-layer filesystem
		if ${ALL_LAYERS}; then
			DISPLAY_MESSAGE "Cannot specify '--all' as this is not a multi-layer filesystem ISO."
			FORCED_EXIT
		fi
		SQUASHFS_FOR_LIVE=filesystem.squashfs
		IMAGE="iso/${ISO_SQUASHFS_DIRECTORY}/${SQUASHFS_FOR_LIVE}"
		sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
		sudo losetup -f > /dev/null 2>&1 || FORCED_EXIT
		LOOP_DEVICE=$(sudo losetup -f)
		LOOP_SQUASH="${LOOP_SQUASH} ${LOOP_DEVICE}"
		sudo losetup ${LOOP_DEVICE} "${IMAGE}"
		FSTYPE=$(sudo blkid -s TYPE -o value ${LOOP_DEVICE} 2>/dev/null)
		if [ "${FSTYPE}" != "squashfs" ]; then
			DISPLAY_MESSAGE "Unknown file system type for '${SQUASHFS_FOR_LIVE}."
			FORCED_EXIT
		fi
		sudo mkdir -p "${SQUASHFS_FOR_LIVE}"
		sudo mount -t "${FSTYPE}" -o ro,noatime "${LOOP_DEVICE}" "${SQUASHFS_FOR_LIVE}" 2> /dev/null
		COMMAND_SUCCESSFUL=$?
		if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
			DISPLAY_MESSAGE "Can not mount ${LOOP_DEVICE} on ${SQUASHFS_FOR_LIVE}"
			FORCED_EXIT
		fi
		MOUNTED_SQUASHFS="${SQUASHFS_FOR_LIVE}"
		SQUASHFS_TYPE="LIVE"
		SQUASHFS_FOR_LIVE=${MOUNTED_SQUASHFS}
		MOUNTABLE_SQUASHFS_FOR_LIVE=${MOUNTED_SQUASHFS}
	fi
}

function MOUNT_ISO_CHROOT {
	cd ${WIP}
	ISO_CHROOT_MOUNTED_SQUASHFS=MOUNTABLE_SQUASHFS_FOR_${1}
	ISO_CHROOT=${!ISO_CHROOT_MOUNTED_SQUASHFS}
	sudo rm -rf squashfs-root iso-chroot
	sudo mkdir iso-chroot
	MOUNTS=""
	for MOUNT in ${ISO_CHROOT}
	do
		MOUNTS="${MOUNTS}:${MOUNT}"
	done
	MOUNTS="${MOUNTS#:}"
	sudo mount -t overlay -o "upperdir=${ISORESPINNER_PARTITION}/upper,lowerdir=${MOUNTS},workdir=${ISORESPINNER_PARTITION}/work" "${ISORESPINNER_PARTITION}" iso-chroot
	COMMAND_SUCCESSFUL=$?
	if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
		DISPLAY_MESSAGE "Can not mount ISO filesystem."
		FORCED_EXIT
	fi
	if ! [ -d iso-chroot/boot -a -d iso-chroot/etc/apt -a -d iso-chroot/etc/default -a -d iso-chroot/usr/src -a -d iso-chroot/lib/modules -a -d iso-chroot/root ]; then
		DISPLAY_MESSAGE "ISO structure not compatible with an Ubuntu, Ubuntu Unity, Kubuntu, Lubuntu, Ubuntu Budgie, Ubuntu GNOME, Ubuntu MATE, Xubuntu or Linux Mint desktop ISO."
		FORCED_EXIT
	fi
	PRESERVE_KEY_ISO_FILES
}

function CHECK_FOR_SYSTEMD {
	# check iso compatibility with options which is different for 22.10 ISOs and up
 	if ([ ${DISTRO_RELEASE} == "22.10" ] && (! sudo chroot iso-chroot dpkg -S systemd 2> /dev/null | grep -sq '/lib/systemd/systemd$')) || ([ ${DISTRO_RELEASE} != "22.10" ] && (! sudo chroot iso-chroot dpkg -S systemd 2> /dev/null | grep -sq linuxx64.efi.stub)); then
		DISPLAY_MESSAGE "Respinning is only compatible with an ISO that uses 'systemd'."
		FORCED_EXIT
	fi
	SYSTEMD_CHECKED=true
}

function EXTRACT_ISORESPINNER_FILES {
	DISPLAY_PROGRESS "Extracting isorespinner files ..."
	cd ${WIP}
	sudo rm -f isorespinner.zip
	sudo sed '1,/^exit 0$/d' < ${ISORESPINNER_SCRIPT} | base64 -d | sudo tee isorespinner.zip > /dev/null
	sudo unzip isorespinner.zip > /dev/null 2>&1
	sudo rm -f isorespinner.zip
}

function FETCH_MAINLINE_DEBS {
	DISPLAY_PROGRESS "Fetching mainline kernel packages ..."
	cd ${WIP}
	sudo rm -f index.html
	sudo wget --timeout=10 ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT} -qO index.html
	if [ ! -f index.html ]; then
		DISPLAY_MESSAGE "Failed to fetch mainline kernel index."
		FORCED_EXIT
	fi
	FETCH_FILE=$(sed -n '/href=/{/all/{/headers/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	# starting with v5.8-rc1, v5.7.2, v5.6.18 and v5.4.46 etc (2020-07-15) and with exceptions (v5.7) the build process changed and now includes an architecture directory (amd64)
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Failed to fetch '${MAINLINE_BRANCH}' header file."
		FORCED_EXIT
	fi
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/headers/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Failed to fetch '${MAINLINE_BRANCH}' kernel header file."
		FORCED_EXIT
	fi
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/image/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Failed to fetch '${MAINLINE_BRANCH}' kernel image file."
		FORCED_EXIT
	fi
	# support for separate kernel modules binary
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/modules/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	if [ -n "${FETCH_FILE#amd64/}" ]; then
		LINUX_MODULES=true
		sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
		if [ ! -f "${FETCH_FILE#amd64/}" ]; then
			DISPLAY_MESSAGE "Failed to fetch '${MAINLINE_BRANCH}' kernel modules file."
			FORCED_EXIT
		fi
	else
		LINUX_MODULES=false
	fi
	NEED_TO_FETCH_MAINLINE_DEBS=false
	sudo rm -f index.html
}

function PRESERVE_KEY_ISO_FILES {
	cd ${WIP}
	if [ -f iso-chroot/.isorespinner.$$.do_not_touch -o -d iso-chroot/.isorespinner.$$.do_not_touch ]; then
		DISPLAY_MESSAGE "Cannot create temporary isorespinner directory."
		FORCED_EXIT
	else
		sudo mkdir iso-chroot/.isorespinner.$$.do_not_touch
	fi
	sudo mkdir iso-chroot/.isorespinner.$$.do_not_touch/etc
	if [ -e "iso-chroot/etc/mtab" -o -h "iso-chroot/etc/mtab" ]; then
		REMOVE_ETC_MTAB=false
		RESTORE_ETC_MTAB=true
		sudo mv iso-chroot/etc/mtab iso-chroot/.isorespinner.$$.do_not_touch/etc/mtab
		sudo cp -Pa iso-chroot/.isorespinner.$$.do_not_touch/etc/mtab iso-chroot/etc/mtab
	else
		REMOVE_ETC_MTAB=true
		RESTORE_ETC_MTAB=false
	fi
	if [ -f iso-chroot/etc/resolv.conf -o -h iso-chroot/etc/resolv.conf ]; then
		sudo mv iso-chroot/etc/resolv.conf iso-chroot/.isorespinner.$$.do_not_touch/etc/resolv.conf
	fi
	# dev media mnt opt proc run snap srv sys tmp
	for DIRECTORY in proc dev run tmp
	do
		sudo mv iso-chroot/${DIRECTORY} iso-chroot/.isorespinner.$$.do_not_touch/${DIRECTORY}
		sudo cp -a iso-chroot/.isorespinner.$$.do_not_touch/${DIRECTORY} iso-chroot/${DIRECTORY}
	done
	sudo cp /etc/resolv.conf iso-chroot/etc/
	if ! ${ADD_REPOSITORY}; then
		sudo mkdir iso-chroot/.isorespinner.$$.do_not_touch/etc/apt
		sudo mv iso-chroot/etc/apt/sources.list iso-chroot/.isorespinner.$$.do_not_touch/etc/apt/sources.list
		if $(grep -sqm1 "universe multiverse" iso-chroot/.isorespinner.$$.do_not_touch/etc/apt/sources.list); then
			sudo cp iso-chroot/.isorespinner.$$.do_not_touch/etc/apt/sources.list iso-chroot/etc/apt/sources.list
		else
			sudo sed 's/\(deb http.*\)$/\1 universe multiverse/' iso-chroot/.isorespinner.$$.do_not_touch/etc/apt/sources.list | sudo tee iso-chroot/etc/apt/sources.list > /dev/null
		fi
	fi
	sudo mount -t proc none iso-chroot/proc
	sudo mount -t sysfs none iso-chroot/sys
	sudo mount --bind /dev/ iso-chroot/dev
	sudo mount -t devpts none iso-chroot/dev/pts
	sudo chroot iso-chroot apt-get update --allow-insecure-repositories > /dev/null 2>&1
}

function GET_LATEST_INITRD_AND_LATEST_VMLINUZ {
	cd ${WIP}
	LATEST_INITRD=""
	LATEST_VMLINUZ=""
	INITRD_RELEASE=""
	VMLINUZ_RELEASE=""
	LATEST_INITRD=$(find iso-chroot/boot -maxdepth 1 -name initrd* -type f)
	if [ -n "${LATEST_INITRD}" ]; then
		LATEST_INITRD=$(ls -tC1 ${LATEST_INITRD} | head -1)
	else
		LATEST_INITRD=$(ls -la iso-chroot/boot/initrd.img 2> /dev/null | sed 's/.* -> .*\///' | sed 's/.* -> //')
		if [ -n "${LATEST_INITRD}" ]; then
			LATEST_INITRD="iso-chroot/boot/${LATEST_INITRD}"
		else
			LATEST_INITRD=""
		fi
	fi
	INITRD_RELEASE=${LATEST_INITRD#iso-chroot/boot/initrd.img-}
	if [ -z "${INITRD_RELEASE}" ]; then
		INITRD_RELEASE=$(find iso-chroot/lib/modules -mindepth 1 -maxdepth 1 -type d)
		if [ -n "${INITRD_RELEASE}" ]; then
			INITRD_RELEASE=$(ls -tC1d iso-chroot/lib/modules/* | head -1)
			INITRD_RELEASE=${INITRD_RELEASE#iso-chroot/lib/modules/}
		else
			INITRD_RELEASE=""
		fi
	fi
	if [ -d "iso-chroot/lib/modules/${INITRD_RELEASE}" ]; then
		LATEST_VMLINUZ=$(find iso-chroot/boot -maxdepth 1 -name vmlinuz-${INITRD_RELEASE}.efi.signed -type f)
		if [ -n "${LATEST_VMLINUZ}" ]; then
			LATEST_VMLINUZ=$(ls -tC1 ${LATEST_VMLINUZ} | head -1)
		else
			LATEST_VMLINUZ=$(find iso-chroot/boot -maxdepth 1 -name vmlinuz-${INITRD_RELEASE} -type f)
			if [ -n "${LATEST_VMLINUZ}" ]; then
				LATEST_VMLINUZ=$(ls -tC1 ${LATEST_VMLINUZ} | head -1)
			else
				LATEST_VMLINUZ=$(ls -la iso-chroot/boot/vmlinuz 2> /dev/null | sed 's/.* -> .*\///' | sed 's/.* -> //')
				if [ -n "${LATEST_VMLINUZ}" ]; then
					LATEST_VMLINUZ="iso-chroot/boot/${LATEST_VMLINUZ}"
				else
					LATEST_VMLINUZ=""
				fi
			fi
		fi
		if [ -f "${LATEST_VMLINUZ}" ]; then
			VMLINUZ_RELEASE=$(sudo file ${LATEST_VMLINUZ} | sed 's/^.*version \([^ ]*\).*/\1/')
		else
			VMLINUZ_RELEASE=${LATEST_VMLINUZ#iso-chroot/boot/vmlinuz-}
			if [ -z "${VMLINUZ_RELEASE}" ]; then
				VMLINUZ_RELEASE=${INITRD_RELEASE}
			fi
		fi
	else
		LATEST_VMLINUZ=""
		VMLINUZ_RELEASE=${INITRD_RELEASE}
	fi
}

function RESTORE_KEY_ISO_FILES {
	cd ${WIP}
	if [ -f iso-chroot/etc/initramfs-tools/modules ]; then
		if (! grep -sq '^overlay$' iso-chroot/etc/initramfs-tools/modules); then echo overlay | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; fi
		if (! grep -sq '^pwm-lpss$' iso-chroot/etc/initramfs-tools/modules); then echo pwm-lpss | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; fi
		if (! grep -sq '^pwm-lpss-platform$' iso-chroot/etc/initramfs-tools/modules); then echo pwm-lpss-platform | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; fi
	fi
	if ${UPDATE_KERNEL} || ${PURGE_PACKAGE} || ${ADD_PACKAGE} || ${ADD_LOCAL_PACKAGE}; then UPDATE_INITRAMFS=true; fi
	if ${UPDATE_INITRAMFS}; then
		sudo chroot iso-chroot bash -c "${UPDATE_INITRAMFS_ENVIRONMENT} update-initramfs -u" > /dev/null 2>&1
		GET_LATEST_INITRD_AND_LATEST_VMLINUZ
		sudo chroot iso-chroot depmod -a ${VMLINUZ_RELEASE} > /dev/null 2>&1
	fi
	sudo chroot iso-chroot apt-get -y autoremove --purge > /dev/null 2>&1
	sudo chroot iso-chroot apt-get -y clean > /dev/null 2>&1
	sudo sync
	sudo sync
	UMOUNT iso-chroot/dev/pts
	UMOUNT iso-chroot/dev
	UMOUNT iso-chroot/sys
	UMOUNT iso-chroot/proc
	if ! ${ADD_REPOSITORY}; then
		sudo mv iso-chroot/.isorespinner.$$.do_not_touch/etc/apt/sources.list iso-chroot/etc/apt/sources.list
		sudo rmdir iso-chroot/.isorespinner.$$.do_not_touch/etc/apt
	fi
	if [ -f iso-chroot/.isorespinner.$$.do_not_touch/etc/resolv.conf -o -h iso-chroot/.isorespinner.$$.do_not_touch/etc/resolv.conf ]; then
		sudo mv iso-chroot/.isorespinner.$$.do_not_touch/etc/resolv.conf iso-chroot/etc/resolv.conf
	fi
	if ${REMOVE_ETC_MTAB}; then
		sudo rm -rf iso-chroot/etc/mtab
	elif ${RESTORE_ETC_MTAB}; then
		sudo rm -rf iso-chroot/etc/mtab
		sudo mv iso-chroot/.isorespinner.$$.do_not_touch/etc/mtab iso-chroot/etc/mtab
	fi
	sudo rmdir iso-chroot/.isorespinner.$$.do_not_touch/etc
	for DIRECTORY in proc dev run tmp
	do
		sudo rm -rf iso-chroot/${DIRECTORY}
		sudo mv iso-chroot/.isorespinner.$$.do_not_touch/${DIRECTORY} iso-chroot/${DIRECTORY}
	done
	sudo rmdir iso-chroot/.isorespinner.$$.do_not_touch
	sudo rm -f iso-chroot/var/lib/dpkg/status-old
	sudo rm -f iso-chroot/boot/grub/grub.cfg
	sudo rm -f iso-chroot/root/.bash_history
}

function UPDATE_ISO_KERNEL_AND_INITRAMFS {
	cd ${WIP}
	GET_LATEST_INITRD_AND_LATEST_VMLINUZ
	if [ "${LATEST_INITRD}" -nt "iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD}" ]; then
		if [ -f "${LATEST_INITRD}" ]; then
			sudo cp ${LATEST_INITRD} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD}
		fi
		if [ "$(sudo file iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ} | sed 's/^.*version \([^ ]*\).*/\1/')" != "${INITRD_RELEASE}" ]; then
			if [ -f "${LATEST_VMLINUZ}" ]; then
				sudo cp ${LATEST_VMLINUZ} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ}
			fi
		fi
	fi
	if [ "${LATEST_VMLINUZ}" -nt "iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ}" ]; then
		if [ -f "${LATEST_VMLINUZ}" ]; then
			sudo cp ${LATEST_VMLINUZ} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ}
		fi
	fi
}

function INTERACTION {
	cd ${WIP}
	if ${MULTI_LAYER_FILESYSTEM}; then
		${NOT_DISPLAYED} && DISPLAY_MESSAGE "The first interaction will be for the '${SQUASH_LAYERS,,}' language layer and the second will be for the 'live' layer ..." && NOT_DISPLAYED=false
		if [ ${SQUASH_LAYERS} == "LIVE" ]; then
			DISPLAY_WARNING "The following changes are only to the 'live' layer and will not be available after installation of the respun ISO."
			INTERACTION_USAGE="with the distro's 'live' layer"
		else
			DISPLAY_WARNING "The following changes are only to the '${SQUASH_LAYERS,,}' language layer and will not be available during live usage of the respun ISO."
			INTERACTION_USAGE="with the distro's '${SQUASH_LAYERS,,}' language layer"
		fi
	else
		INTERACTION_USAGE="with distro"
	fi
	sudo grep '^snap:' pre-filesystem.${FILESYSTEM_FILES} | sudo tee snaps.${FILESYSTEM_FILES} > /dev/null
	sudo chroot iso-chroot dpkg-query -W | sudo tee pre-filesystem-${SQUASH_LAYERS,,}.${FILESYSTEM_FILES} > /dev/null
	sudo cat snaps.${FILESYSTEM_FILES} | sudo tee -a pre-filesystem-${SQUASH_LAYERS,,}.${FILESYSTEM_FILES} > /dev/null
	DISPLAY_PROGRESS "Starting interaction ${INTERACTION_USAGE} ..."
	sudo script -qc "sudo HOME=/root LC_ALL=C chroot iso-chroot /bin/bash" interactive-${SQUASH_LAYERS,,}.log
	DISPLAY_PROGRESS "Finishing interaction ${INTERACTION_USAGE} ..."
	echo "Starting interaction ${INTERACTION_USAGE} ..." >> ${ISORESPINNER_LOGFILE}
	if ${DEBUG}; then
		sudo cat interactive-${SQUASH_LAYERS,,}.log | sed '1d' | sed 'N;$!P;$!D;$d' >> ${ISORESPINNER_LOGFILE}
	else
		while read -r
		do
			if [ -n "${REPLY}" ]; then
				echo "Command '${REPLY}' ran ..." >> ${ISORESPINNER_LOGFILE}
			fi
		done <<< $(sudo sed 's/\x1B\]0;/\n/' interactive-${SQUASH_LAYERS,,}.log | tr -d '\r' | grep "^[^@]*@$(hostname -s)" | sed 's/^[^ ]* [^ ]* //')
	fi
	echo "Finishing interaction ${INTERACTION_USAGE} ..." >> ${ISORESPINNER_LOGFILE}
	sudo chroot iso-chroot dpkg-query -W | sudo tee post-filesystem-${SQUASH_LAYERS,,}.${FILESYSTEM_FILES} > /dev/null
	sudo cat snaps.${FILESYSTEM_FILES} | sudo tee -a post-filesystem-${SQUASH_LAYERS,,}.${FILESYSTEM_FILES} > /dev/null
	sudo rm -f snaps.${FILESYSTEM_FILES}
}

