function UPDATE_KERNEL_PARAMETERS {
	cd ${WIP}
	${PROCESSING_LIVE_SQUASH_LAYERS} && sudo cp iso-chroot/etc/default/grub iso-chroot/etc/default/grub.orig
	CURRENT_KERNEL_BOOT_PARAMETER=$(grep -m1 "^GRUB_CMDLINE_LINUX_DEFAULT=" iso-chroot/etc/default/grub)
	CURRENT_KERNEL_BOOT_PARAMETER=${CURRENT_KERNEL_BOOT_PARAMETER#GRUB_CMDLINE_LINUX_DEFAULT=}
	CURRENT_KERNEL_BOOT_PARAMETER=${CURRENT_KERNEL_BOOT_PARAMETER//\"/}
	if [ -n "${CURRENT_KERNEL_BOOT_PARAMETER}" ]; then
		if ${ADD_KERNEL_BOOT_PARAMETER}; then
			${PROCESSING_LIVE_SQUASH_LAYERS} && sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}/${CURRENT_KERNEL_BOOT_PARAMETER} ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
			sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}/${CURRENT_KERNEL_BOOT_PARAMETER} ${KERNEL_BOOT_PARAMETER}/" iso-chroot/etc/default/grub
			${PROCESSING_LIVE_SQUASH_LAYERS} && echo "Kernel boot parameters '${KERNEL_BOOT_PARAMETER}' added ..." >> ${ISORESPINNER_LOGFILE}
		fi
		if ${DELETE_KERNEL_BOOT_PARAMETERS}; then
			${PROCESSING_LIVE_SQUASH_LAYERS} && sudo sed -i "s/ ${CURRENT_KERNEL_BOOT_PARAMETER}//" iso-directory-structure/boot/grub/grub.cfg
			if ${ADD_KERNEL_BOOT_PARAMETER}; then
				sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER} //" iso-chroot/etc/default/grub
			else
				sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}//" iso-chroot/etc/default/grub
			fi
			${PROCESSING_LIVE_SQUASH_LAYERS} && echo "Initial kernel boot parameters '${CURRENT_KERNEL_BOOT_PARAMETER}' deleted ..." >> ${ISORESPINNER_LOGFILE}
		fi
	else
		if ${ADD_KERNEL_BOOT_PARAMETER}; then
			if ${PROCESSING_LIVE_SQUASH_LAYERS}; then
				if ${BOOT_CASPER}; then
					sudo sed -i "s/boot=casper/boot=casper ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
				else
					if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/grub.cfg); then
						sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/grub.cfg
					fi
					sudo sed -i "s/${PRESEED_SEED}/${PRESEED_SEED} ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
				fi
			fi
			sudo sed -i "s/^GRUB_CMDLINE_LINUX_DEFAULT=\"\"/GRUB_CMDLINE_LINUX_DEFAULT=\"${KERNEL_BOOT_PARAMETER}\"/" iso-chroot/etc/default/grub
			${PROCESSING_LIVE_SQUASH_LAYERS} && echo "Kernel boot parameters '${KERNEL_BOOT_PARAMETER}' added ..." >> ${ISORESPINNER_LOGFILE}
		fi
		if ${DELETE_KERNEL_BOOT_PARAMETERS}; then
			${PROCESSING_LIVE_SQUASH_LAYERS} && echo "No initial kernel boot parameters found for deletion ..." >> ${ISORESPINNER_LOGFILE}
		fi
	fi
}

function UPDATE_BOOTLOADER {
	DISPLAY_PROGRESS "Processing bootloader ..."
	cd ${WIP}
	# 20.04 and up no longer uses 'boot=casper' in 'grub.cfg' and now uses 'maybe-ubiquity'
	if $(grep -sqm1 "boot=casper" iso-directory-structure/boot/grub/grub.cfg); then
		BOOT_CASPER=true
	else
		BOOT_CASPER=false
	fi
	# check installer as Lubuntu started using 'calamares' instead of 'ubiquity' since 18.10
	if $(sudo chroot iso-chroot dpkg-query -W -f='${Status}\n' ubiquity 2> /dev/null | grep -sq ^install); then
		INSTALLER_IS_UBIQUITY=true
		INSTALLER_IS_CALAMARES=false
		INSTALLER_IS_SNAP=false
	elif $(sudo chroot iso-chroot dpkg-query -W -f='${Status}\n' calamares 2> /dev/null | grep -sq ^install); then 
		INSTALLER_IS_CALAMARES=true
		INSTALLER_IS_UBIQUITY=false
		INSTALLER_IS_SNAP=false
		if [ ! -d iso-chroot/etc/calamares ]; then
			DISPLAY_MESSAGE "ISO structure not compatible with Calamares installer."
			FORCED_EXIT
		else
			sudo sed -i 's/apt-cdrom add \(.*\)/apt-cdrom add \1 || exit 0/' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
			sudo sed -i 's/apt-get update/apt-get update --allow-insecure-repositories/' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
			sudo sed -i 's/apt install/apt install -o Acquire::AllowInsecureRepositories=true -o APT::Get::AllowUnauthenticated=true -o APT::Get::allow-remove-essential=true/' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
			if ${GRUB_32}; then
				sudo sed -i '/shim-signed/,+1d' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
			fi
		fi
	elif [ -f iso-chroot/var/lib/snapd/seed/assertions/ubuntu-desktop-installer_[0-9]*.assert ]; then
		INSTALLER_IS_UBIQUITY=false
		INSTALLER_IS_CALAMARES=false
		INSTALLER_IS_SNAP=true
	else
		DISPLAY_MESSAGE "Cannot determine installer used in ISO."
		FORCED_EXIT
	fi
	if ${ADD_KERNEL_BOOT_PARAMETER} || ${DELETE_KERNEL_BOOT_PARAMETERS}; then
		# use preseed file if missing from distro grub.cfg
		if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/grub.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/grub.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/grub.cfg
			fi
		fi
		# and for completeness
		if [ -f iso-directory-structure/boot/grub/loopback.cfg ] && (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/loopback.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/loopback.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/loopback.cfg
			fi
		fi
		if ! ${INSTALLER_IS_SNAP}; then
			sudo cp iso-chroot/etc/default/grub iso-chroot/etc/default/grub.isorespinner
		fi
		# add preseed if missing from distro
		sudo mkdir -p iso-directory-structure/preseed && sudo chmod 555 iso-directory-structure/preseed && sudo touch iso-directory-structure/preseed/${PRESEED_SEED} && sudo chmod 444 iso-directory-structure/preseed/${PRESEED_SEED}
		if ! $(diff iso-chroot/etc/default/grub.orig iso-chroot/etc/default/grub > /dev/null 2>&1); then
			# create generic preseed file
			sudo cat <<+ | sudo tee -a iso-directory-structure/preseed/${PRESEED_SEED} > /dev/null
# Linuxium 'isorespinner.sh' isorespinner: Begin
# ubiquity	ubiquity/success_command string \\
# TARGET=MOUNT_POINT; \\
# mv \${TARGET}/etc/default/grub.isorespinner \${TARGET}/etc/default/grub
# Linuxium 'isorespinner.sh' isorespinner: End
+
			if ${INSTALLER_IS_UBIQUITY}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/s/^# //' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/^Linuxium/# Linuxium/' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/TARGET=MOUNT_POINT/TARGET=\/target/' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
			if ${INSTALLER_IS_CALAMARES}; then
				sudo sed '/^# Linuxium.*Begin/,/^# Linuxium.*End/!d;//d;s/# //;s/; \\$//;s/MOUNT_POINT/$1/;/^ubiquity/c #!/bin/sh' iso-directory-structure/preseed/${PRESEED_SEED} | sudo tee iso-chroot/etc/calamares/modules/isorespinner > /dev/null
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/d' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo chmod 700 iso-chroot/etc/calamares/modules/isorespinner
				sudo sed -i "/id: logs/i - id: isorespinner\n\\ \\ module: shellprocess\n\\ \\ config: shellprocess_isorespinner.conf" iso-chroot/etc/calamares/settings.conf
				sudo sed -i "/packages/i \\ \\ - shellprocess@isorespinner" iso-chroot/etc/calamares/settings.conf
				sudo cat <<+ | sudo tee iso-chroot/etc/calamares/modules/shellprocess_isorespinner.conf > /dev/null
---
dontChroot: true
timeout: 10
script:
    - /etc/calamares/modules/isorespinner @@ROOT@@
    - rm -f @@ROOT@@/etc/calamares/modules/isorespinner @@ROOT@@/etc/calamares/modules/shellprocess_isorespinner.conf
+
			fi
			if ${INSTALLER_IS_SNAP}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/d' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
		fi
	fi
	sudo rm -f iso-chroot/etc/default/grub.orig
	if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
		CD_BOOT_IMAGES=cd-boot-images-amd64
		CANDIDATE_CD_BOOT_IMAGES=$(sudo chroot iso-chroot apt-cache policy ${CD_BOOT_IMAGES} | grep -m1 Candidate)
		CANDIDATE_CD_BOOT_IMAGES=${CANDIDATE_CD_BOOT_IMAGES##  Candidate: }
		sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${CD_BOOT_IMAGES}/${CANDIDATE_CD_BOOT_IMAGES}/+index -qO .index.html
		if [ -s .index.html ]; then
			CD_BOOT_IMAGES_PACKAGE=$(grep ${CD_BOOT_IMAGES}_${CANDIDATE_CD_BOOT_IMAGES} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
			sudo rm -f .index.html
			if [ -n "${CD_BOOT_IMAGES_PACKAGE}" ]; then
				sudo wget --timeout=10 -q ${CD_BOOT_IMAGES_PACKAGE}
			fi
		fi
		if [ -s cd-boot-images-amd64*.deb ]; then
			sudo ar x cd-boot-images-amd64_*_all.deb
			# new compression used in packaging for 21.10 and up
			if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" ]; then
				sudo tar -I zstd -xf data.tar.zst
			else
				sudo tar xf data.tar.xz
			fi
			sudo dd if=usr/share/cd-boot-images-amd64/images/boot/grub/i386-pc/boot_hybrid.img bs=1 count=446 of=iso.mbr > /dev/null 2>&1
			sudo mv usr/share/cd-boot-images-amd64/images/boot/grub/efi.img iso.efi
			sudo rm -rf usr cd-boot-images-amd64_*_all.deb control.tar.* data.tar.* debian-binary
		else
			sudo dd if=${ISO} bs=1 count=446 of=iso.mbr > /dev/null 2>&1
			if [ ! -s iso.mbr ]; then
				DISPLAY_MESSAGE "Cannot extract MBR from ISO '${ISO}'"
				FORCED_EXIT
			fi
			sudo dd if=${ISO} skip=$(fdisk -l ${ISO} | fgrep '.iso2' | awk '{print $2}') count=$(fdisk -l ${ISO} | fgrep '.iso2 ' | awk '{print $4}') of=iso.efi > /dev/null 2>&1
			if [ ! -s iso.efi ]; then
				DISPLAY_MESSAGE "Cannot extract EFI from ISO '${ISO}'"
				FORCED_EXIT
			fi
		fi
	else
		sudo dd if=${ISO} bs=1 count=446 of=iso.mbr > /dev/null 2>&1
		if [ ! -s iso.mbr ]; then
			DISPLAY_MESSAGE "Cannot extract MBR from ISO '${ISO}'"
			FORCED_EXIT
		fi
		if [ -s iso-directory-structure/boot/grub/efi.img ]; then
			sudo cp iso-directory-structure/boot/grub/efi.img iso.efi
		else
			sudo dd if=${ISO} skip=$(fdisk -l ${ISO} | fgrep '.iso2' | awk '{print $2}') count=$(fdisk -l ${ISO} | fgrep '.iso2 ' | awk '{print $4}') of=iso.efi > /dev/null 2>&1
			if [ ! -s iso.efi ]; then
				DISPLAY_MESSAGE "Cannot extract EFI from ISO '${ISO}'"
				FORCED_EXIT
			fi
		fi
	fi
	if ${GRUB_32}; then
		if [ ! -f iso-directory-structure/dists/${DISTRO_CODENAME}/main/binary-amd64/${DISTRO_PACKAGES} ]; then
			DISPLAY_MESSAGE "Cannot add 32-bit GRUB packages."
			FORCED_EXIT
		else
			DISPLAY_PROGRESS "Adding 32-bit GRUB bootloader ..."
		fi
		if ${INSTALLER_IS_SNAP}; then
			INSTALLED_LINUX_PACKAGES=$(sudo chroot iso-chroot apt-cache policy linux-generic* | grep -B1 'Installed:' | sed '/^--$/d' | paste - - | grep -v '(none)' | sed 's/:.*//')
			if [ -z "${INSTALLED_LINUX_PACKAGES}" ]; then
				LINUX_PACKAGE="linux-generic"
			else
				for LINUX_PACKAGE in ${INSTALLED_LINUX_PACKAGES}
				do
					if [ "${LINUX_PACKAGE}" == "linux-generic" ]; then
						break
					fi
				done
			fi
		fi
		GRUB_EFI_IA32=grub-efi-ia32
		CANDIDATE_GRUB_EFI_IA32=$(sudo chroot iso-chroot apt-cache policy ${GRUB_EFI_IA32} | grep -m1 Candidate)
		CANDIDATE_GRUB_EFI_IA32=${CANDIDATE_GRUB_EFI_IA32##  Candidate: }
		GRUB_EFI_IA32_BIN=grub-efi-ia32-bin
		CANDIDATE_GRUB_EFI_IA32_BIN=$(sudo chroot iso-chroot apt-cache policy ${GRUB_EFI_IA32_BIN} | grep -m1 Candidate)
		CANDIDATE_GRUB_EFI_IA32_BIN=${CANDIDATE_GRUB_EFI_IA32_BIN##  Candidate: }
		sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${GRUB_EFI_IA32}/${CANDIDATE_GRUB_EFI_IA32}/+index -qO .index.html
		if [ -s .index.html ]; then
			GRUB_EFI_PACKAGE_TO_DOWNLOAD=$(grep ${GRUB_EFI_IA32}_${CANDIDATE_GRUB_EFI_IA32} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
			sudo rm -f .index.html
			if [ -n "${GRUB_EFI_PACKAGE_TO_DOWNLOAD}" ]; then
				sudo wget --timeout=10 -q ${GRUB_EFI_PACKAGE_TO_DOWNLOAD}
			fi
		fi
		if [ -s grub-efi-ia32*.deb ]; then
			sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${GRUB_EFI_IA32_BIN}/${CANDIDATE_GRUB_EFI_IA32_BIN}/+index -qO .index.html
			if [ -s .index.html ]; then
				GRUB_EFI_PACKAGE_TO_DOWNLOAD=$(grep ${GRUB_EFI_IA32_BIN}_${CANDIDATE_GRUB_EFI_IA32_BIN} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
				sudo rm -f .index.html
				if [ -n "${GRUB_EFI_PACKAGE_TO_DOWNLOAD}" ]; then
					sudo wget --timeout=10 -q ${GRUB_EFI_PACKAGE_TO_DOWNLOAD}
				fi
			fi
			if [ -s grub-efi-ia32-bin*.deb ]; then
				if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
					if [ -d iso-directory-structure/pool/main ]; then
						if [ ! -d iso-directory-structure/pool/main/g/grub2 ]; then
							sudo mkdir -p iso-directory-structure/pool/main/g/grub2
							sudo chmod 555 iso-directory-structure/pool/main/g iso-directory-structure/pool/main/g/grub2
						fi
					else
						DISPLAY_MESSAGE "Could not add 32-bit GRUB packages."
						FORCED_EXIT
					fi
				fi
				sudo rm -f iso-directory-structure/pool/main/g/grub2/grub-efi-ia32*.deb
				GRUB_PACKAGES=$(ls -C1 grub-efi-ia32*.deb | xargs)
				sudo mv grub-efi-ia32*.deb iso-directory-structure/pool/main/g/grub2
				sudo chmod 444 iso-directory-structure/pool/main/g/grub2/grub-efi-ia32*.deb
				if ${DEBUG}; then echo "Adding 32-bit GRUB packages '${GRUB_PACKAGES}' ..." >> ${ISORESPINNER_LOGFILE}; fi
			else
				DISPLAY_WARNING "Failed to add 32-bit GRUB packages ..."
 				sudo rm -f grub-efi-ia32*.deb
			fi
		else
			DISPLAY_WARNING "Failed to add 32-bit GRUB packages ..."
 			sudo rm -f grub-efi-ia32*.deb
		fi
		EFI_CURRENT_SIZE=$(du -sxb iso.efi | awk '{print $1}')
		EFI_GRUB_SIZE=$(du -sxb grub_bootia32.efi | awk '{print $1}')
		EFI_REQUIRED_SIZE=$((EFI_CURRENT_SIZE+EFI_GRUB_SIZE))
		sudo mkdir mnt
		sudo mount iso.efi mnt
		EFI_DIRECTORY=$(ls mnt | grep -i "^efi$")
		sudo cp -a mnt/${EFI_DIRECTORY} .
		sudo umount mnt
		sudo rm -f iso.efi
		sudo dd if=/dev/zero of=iso.efi bs=1 count=${EFI_REQUIRED_SIZE} > /dev/null 2>&1
		sudo mkdosfs iso.efi > /dev/null 2>&1
		sudo mount iso.efi mnt
		sudo cp -a ${EFI_DIRECTORY} mnt
		sudo cp grub_bootia32.efi mnt/${EFI_DIRECTORY}/boot/bootia32.efi
		sudo umount mnt
		if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
			# add preseed if missing from distro
			sudo mkdir -p iso-directory-structure/preseed && sudo chmod 555 iso-directory-structure/preseed && sudo touch iso-directory-structure/preseed/${PRESEED_SEED} && sudo chmod 444 iso-directory-structure/preseed/${PRESEED_SEED}
			if (sudo grep -sq '^# Linuxium' iso-directory-structure/preseed/${PRESEED_SEED}); then
				sudo sed -i '$d' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i '$ s/$/; \\/' iso-directory-structure/preseed/${PRESEED_SEED}
			else
				sudo cat <<+ | sudo tee -a iso-directory-structure/preseed/${PRESEED_SEED} > /dev/null
# Linuxium 'isorespinner.sh' isorespinner: Begin
# ubiquity	ubiquity/success_command string \\
+
			fi
			sudo cat <<+ | sudo tee -a iso-directory-structure/preseed/${PRESEED_SEED} > /dev/null
# TARGET=MOUNT_POINT; \\
# if [ \$(cat /sys/firmware/efi/fw_platform_size) = 32 ]; then \\
# mount --bind /proc \${TARGET}/proc; \\
# mount --bind /sys \${TARGET}/sys; \\
# mount --bind /dev \${TARGET}/dev; \\
# mount --bind /dev/pts \${TARGET}/dev/pts; \\
# mount --bind /run \${TARGET}/run; \\
# mount --bind /sys/firmware/efi/efivars \${TARGET}/sys/firmware/efi/efivars; \\
# cp /cdrom/pool/main/g/grub2/grub-efi-ia32_*.deb \${TARGET}/usr/src/grub-efi-ia32.deb; \\
# cp /cdrom/pool/main/g/grub2/grub-efi-ia32-bin_*.deb \${TARGET}/usr/src/grub-efi-ia32-bin.deb; \\
# echo "$(basename ${0}): Installing 32-bit grub bootloader"; \\
# for PACKAGE in \$(dpkg -l shim-signed 2> /dev/null | grep '^ii' | awk '{print \$2}'); do \\
# chroot \${TARGET} apt -y purge --allow-remove-essential \${PACKAGE} > /dev/null 2>&1; done; \\
# for PACKAGE in \$(dpkg -l grub-efi-amd64* 2> /dev/null | grep '^ii' | awk '{print \$2}'); do \\
# chroot \${TARGET} apt -y purge --allow-remove-essential \${PACKAGE} > /dev/null 2>&1; done; \\
# if chroot \${TARGET} apt -y install --allow-remove-essential /usr/src/grub-efi-ia32.deb /usr/src/grub-efi-ia32-bin.deb > \${TARGET}/usr/src/.package.log 2>&1; then \\
# INSTALL_DEVICE=/dev/\$(lsblk -no pkname \$(mount | grep \${TARGET}/boot/efi | awk '{print \$1}')); \\
# echo "$(basename ${0}): Running chroot \${TARGET} grub-install --force --target=i386-efi \\"\${INSTALL_DEVICE}\\""; \\
# chroot \${TARGET} grub-install --force --target=i386-efi \${INSTALL_DEVICE}; \\
# else echo "$(basename ${0}): Failed to install:"; cat \${TARGET}/usr/src/.package.log; fi; \\
# rm -f \${TARGET}/usr/src/.package.log \${TARGET}/usr/src/grub-efi-ia32.deb \${TARGET}/usr/src/grub-efi-ia32-bin.deb; \\
# umount -f \${TARGET}/sys/firmware/efi/efivars; \\
# umount -f \${TARGET}/run; \\
# umount -f \${TARGET}/dev/pts; \\
# umount -f \${TARGET}/dev; \\
# umount -f \${TARGET}/sys; \\
# umount -f \${TARGET}/proc; \\
# cp -a /var/log/syslog \${TARGET}/var/log/installer/syslog; \\
# fi
# Linuxium 'isorespinner.sh' isorespinner: End
+
			if ${INSTALLER_IS_UBIQUITY}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/s/^# //' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/^Linuxium/# Linuxium/' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/TARGET=MOUNT_POINT/TARGET=\/target/' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
			if ${INSTALLER_IS_CALAMARES}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/d' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
			if ${INSTALLER_IS_SNAP}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/d' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
		fi
		sudo rmdir mnt
		sudo rm -rf ${EFI_DIRECTORY}
		sudo cp -a grub/i386-efi iso-directory-structure/boot/grub
		EFI_DIRECTORY=$(ls iso-directory-structure | grep -i "^efi$")
		BOOT_DIRECTORY=$(ls iso-directory-structure/${EFI_DIRECTORY} | grep -i "^boot$")
		sudo cp efi_bootia32.efi iso-directory-structure/EFI/${BOOT_DIRECTORY}/bootia32.efi
		if [ "${DISTRO_RELEASE}" != "22.10" -a "${DISTRO_RELEASE}" != "22.04" -a "${DISTRO_RELEASE}" != "21.10" -a "${DISTRO_RELEASE}" != "21.04" -a "${DISTRO_RELEASE}" != "20.10" ]; then
			sudo rm -f iso-directory-structure/boot/grub/efi.img
			sudo cp iso.efi iso-directory-structure/boot/grub/efi.img
			# as 20.10 and up no longer contains this grub.cfg file
			sudo cp iso-directory-structure/boot/grub/x86_64-efi/grub.cfg iso-directory-structure/boot/grub/i386-efi
		fi
		echo "32-bit GRUB bootloader added ..." >> ${ISORESPINNER_LOGFILE}
	fi
}

function UPDATE_GRUB_PACKAGES {
	cd ${WIP}
	sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log iso-chroot/usr/src/.grub_packages.error
	sudo chroot iso-chroot /bin/bash > /dev/null 2>&1 <<+
export HOME=/root
export LC_ALL=C
trap '' SIGHUP SIGINT SIGTERM
cd /usr/src
GRUB_PACKAGES=\$(dpkg -l | grep grub | grep ^ii | awk '{print \$2}' | xargs)
echo "\${GRUB_PACKAGES}" > .grub_packages
if ${DEBUG}; then echo "Updating GRUB packages '\${GRUB_PACKAGES}' ..." > .grub_packages.log; fi
DEBIAN_FRONTEND=noninteractive apt-get install -y -o Dpkg::Options::="--force-confdef" -o Dpkg::Options::="--force-confold" \${GRUB_PACKAGES} >> .grub_packages.log 2>&1
PACKAGE_INSTALLED=\$?
if [ \${PACKAGE_INSTALLED} != 0 ]; then
	touch .grub_packages.error
fi
+
	GRUB_PACKAGES=$(sudo cat iso-chroot/usr/src/.grub_packages)
	if ${DEBUG}; then sudo cat iso-chroot/usr/src/.grub_packages.log >> ${ISORESPINNER_LOGFILE}; fi
	if [ -f iso-chroot/usr/src/.grub_packages.error ]; then
		sudo cat iso-chroot/usr/src/.grub_packages.log
		DISPLAY_MESSAGE "GRUB packages '${GRUB_PACKAGES}' failed to update correctly."
		sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log iso-chroot/usr/src/.grub_packages.error
		FORCED_EXIT
	else
		${PROCESSING_LIVE_SQUASH_LAYERS} && echo "GRUB packages updated ..." >> ${ISORESPINNER_LOGFILE}
		sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log
	fi
}

function UPDATE_ISO_POOL_PACKAGES {
	DISPLAY_PROGRESS "Updating ISO repositories ..."
	cd ${WIP}
	if [ -d "${WIP}/iso-directory-structure/pool" ]; then
		sudo mkdir iso-chroot/usr/src/.isorespinner.$$.pool
		cd iso-chroot/usr/src/.isorespinner.$$.pool
		for POOL_PACKAGE in $(find ${WIP}/iso-directory-structure/pool -name \*.deb)
		do
			POOL_PACKAGE_PATH=$(dirname ${POOL_PACKAGE})
			DEBIAN_FILE=$(basename ${POOL_PACKAGE})
			PACKAGE=${DEBIAN_FILE%%_*}
			ARCHITECTURE=${DEBIAN_FILE##*_}
			ARCHITECTURE=${ARCHITECTURE%.deb}
			PACKAGE_CANDIDATE=$(sudo chroot ${WIP}/iso-chroot apt-cache policy ${PACKAGE} | grep -m1 Candidate)
			PACKAGE_CANDIDATE=${PACKAGE_CANDIDATE##  Candidate: }
			if [[ ${PACKAGE_CANDIDATE} =~ ":" ]]; then
				PACKAGE_CANDIDATE=${PACKAGE_CANDIDATE//:/_}
			fi
			POOL_CANDIDATE=${DEBIAN_FILE#*_}
			POOL_CANDIDATE=${POOL_CANDIDATE%_*}
			if [ "${ARCHITECTURE}" == "i386" ]; then
				if ${DEBUG}; then echo "ISO pool package '${PACKAGE}' skipped for architecture '${ARCHITECTURE}' ..." >> ${ISORESPINNER_LOGFILE}; fi
			else
				if [ "${POOL_CANDIDATE}" != "${PACKAGE_CANDIDATE}" ]; then
					sudo chroot ${WIP}/iso-chroot bash -c "cd /usr/src/.isorespinner.$$.pool; apt-get download -y ${PACKAGE}" > /dev/null 2>&1
					if [ -f ${PACKAGE}_*.deb ]; then
						sudo rm -f ${POOL_PACKAGE}
						sudo mv $(ls ${PACKAGE}*.deb) ${POOL_PACKAGE_PATH}/$(ls ${PACKAGE}*.deb | sed 's/%3a/_/g')
						if ${DEBUG}; then echo "ISO pool package '${PACKAGE}' updated ..." >> ${ISORESPINNER_LOGFILE}; fi
					fi
				fi
			fi
		done
		cd ${WIP}
		sudo rm -rf iso-chroot/usr/src/.isorespinner.$$.pool
		sudo mkdir dpkg-dev
		if ! $(command -v dpkg-scanpackages > /dev/null 2>&1); then
			sudo apt-get download -y dpkg-dev > /dev/null 2>&1
			sudo dpkg-deb -x dpkg-dev_*.deb dpkg-dev
			sudo rm -f dpkg-dev_*.deb
			DPKG_DEV_PATH="../dpkg-dev/usr/bin"
		else
			DPKG_DEV_PATH=$(dirname $(type dpkg-scanpackages | awk '{print $3}'))
		fi
		if [ ! -f iso-directory-structure/dists/${DISTRO_CODENAME}/main/binary-amd64/${DISTRO_PACKAGES} ]; then
			DISPLAY_MESSAGE "Cannot update ISO pool packages."
			FORCED_EXIT
		fi
		cd iso-directory-structure
		for POOL_REPOSITORIES in pool/*
		do
			POOL_REPOSITORY=${POOL_REPOSITORIES#pool/}
			if [ ! -d "dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}" ]; then
				continue
			fi
			COMPRESSED_PACKAGES_OLD_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES})
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			sudo ${ZIP_COMMAND} -d -c dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages > /dev/null
			PACKAGES_OLD_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages)
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			sudo ${DPKG_DEV_PATH}/dpkg-scanpackages ${POOL_REPOSITORIES} 2> /dev/null | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages > /dev/null
			PACKAGES_NEW_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages)
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES}
			sudo ${ZIP_COMMAND} -c dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} > /dev/null
			COMPRESSED_PACKAGES_NEW_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES})
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			OLD_LINE=$(echo ${PACKAGES_OLD_MD5SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_MD5SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${PACKAGES_OLD_SHA1SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_SHA1SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${PACKAGES_OLD_SHA256SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_SHA256SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_MD5SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_MD5SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_SHA1SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_SHA1SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_SHA256SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_SHA256SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
		done
		# and because 'Release' has now been modified ...
		# sudo rm -f dists/${DISTRO_CODENAME}/Release.gpg
		cd ..
		sudo rm -rf dpkg-dev
	fi
	echo "ISO repositories updated ..." >> ${ISORESPINNER_LOGFILE}
}

function UPDATE_FILESYSTEM_MANIFEST_SIZE {
	DISPLAY_PROGRESS "Updating filesystem manifest ..."
	cd ${WIP}
	# recreate filesystem.manifest
	sudo grep '^snap:' pre-filesystem.${FILESYSTEM_FILES} | sudo tee snaps.${FILESYSTEM_FILES} > /dev/null
	sudo rm -f iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES}
	sudo chroot iso-chroot dpkg-query -W | sudo tee iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} > /dev/null
	sudo cat snaps.${FILESYSTEM_FILES} | sudo tee -a iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} > /dev/null
	sudo chmod 444 iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES}
	sudo rm -f snaps.${FILESYSTEM_FILES}
	# packages changed in the filesystem
	LAYER_TYPE=${SQUASHFS_TYPE,,}
	for LAYERS in ${LAYER_TYPE}
	do
		if ${INTERACTIVE}; then
			diff --changed-group-format='%>' --unchanged-group-format='' pre-filesystem-${LAYERS}.${FILESYSTEM_FILES} post-filesystem-${LAYERS}.${FILESYSTEM_FILES} | sudo tee packages.${LAYERS}.added > /dev/null
			diff --changed-group-format='%<' --unchanged-group-format='' pre-filesystem-${LAYERS}.${FILESYSTEM_FILES} post-filesystem-${LAYERS}.${FILESYSTEM_FILES} | sudo tee packages.${LAYERS}.removed > /dev/null
			sudo rm -f pre-filesystem-${LAYERS}.${FILESYSTEM_FILES} post-filesystem-${LAYERS}.${FILESYSTEM_FILES}
		else
			diff --changed-group-format='%>' --unchanged-group-format='' pre-filesystem.${FILESYSTEM_FILES} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} | sudo tee packages.${LAYERS}.added > /dev/null
			diff --changed-group-format='%<' --unchanged-group-format='' pre-filesystem.${FILESYSTEM_FILES} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} | sudo tee packages.${LAYERS}.removed > /dev/null
		fi
	done
	sudo rm -f pre-filesystem.${FILESYSTEM_FILES}
	if ${INTERACTIVE}; then
		if ! $(diff packages.${LAYER_TYPE##* }.added packages.${LAYER_TYPE%% *}.added > /dev/null 2>&1) || ! $(diff packages.${LAYER_TYPE##* }.removed packages.${LAYER_TYPE%% *}.removed > /dev/null 2>&1); then
			DISPLAY_WARNING "Integrity of the respun ISO could be compromised as the '--interactive' option resulted in the 'live' layer with different packages to the '${LAYER_TYPE%% *}' language layer."
		fi
	fi
	# recreate filesystem.size
	sudo rm -f iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.size
	ISO_CHROOT_SIZE=$(sudo du -sb --exclude=iso-chroot/proc --exclude=iso-chroot/dev --exclude=iso-chroot/run --exclude=iso-chroot/tmp iso-chroot | cut -f1)
	echo ${ISO_CHROOT_SIZE} | sudo tee iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.size > /dev/null
	sudo chmod 444 iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.size
}

function UNMOUNT_ISORESPINNER_PARTITION {
	cd ${WIP}
	UMOUNT ${ISORESPINNER_PARTITION}
	sudo losetup -d ${LOOP_ISORESPINNER} > /dev/null 2>&1
	LOOP_ISORESPINNER=""
}

function UNMOUNT_ISO_CHROOT {
	cd ${WIP}
	RESTORE_KEY_ISO_FILES
	${PROCESSING_LIVE_SQUASH_LAYERS} && UPDATE_ISO_KERNEL_AND_INITRAMFS
	UMOUNT iso-chroot
	sudo rm -rf iso-chroot
}

function UNMOUNT_SQUASHFS {
	cd ${WIP}
	for SQUASHFS in ${MOUNTED_SQUASHFS}
	do
		UMOUNT ${SQUASHFS}
		sudo rm -rf ${SQUASHFS}
	done
	for LOOP_DEVICE in ${LOOP_SQUASH}
	do
		sudo losetup -d ${LOOP_DEVICE} > /dev/null 2>&1
	done
	LOOP_SQUASH=""
	for LAYERS in ${SQUASHFS_TYPE}
	do
		MOUNTED_SQUASHFS=SQUASHFS_FOR_${LAYERS}
		for SQUASHFS in ${!MOUNTED_SQUASHFS}
		do
			sudo unsquashfs -d ${SQUASHFS} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASHFS} > /dev/null 2>&1
		done
	done
}

function UNMOUNT_ISO {
	cd ${WIP}
	UMOUNT iso
	sudo rm -rf iso
	sudo losetup -d ${LOOP_ISO} > /dev/null 2>&1
	LOOP_ISO=""
}

function APPLYING_ISORESPINS {
	DISPLAY_PROGRESS "Updating filesystem layers ..."
	for SQUASH_LAYERS in ${SQUASHFS_TYPE}
	do
		cd ${WIP}
		MOUNTED_SQUASHFS=SQUASHFS_FOR_${SQUASH_LAYERS}
		SQUASHFS=${!MOUNTED_SQUASHFS}
		ISORESPINNER_PARTITION=isorespins-${SQUASH_LAYERS,,}
		ISORESPINNER_FILESYSTEM=${ISORESPINNER_PARTITION}.ext4
		MOUNT_ISORESPINNER_PARTITION
		for DIRECTORY in proc dev run tmp
		do
			sudo rm -rf ${ISORESPINNER_PARTITION}/upper/${DIRECTORY}
		done
		for DELETION in $(sudo find ${ISORESPINNER_PARTITION}/upper -type c)
		do
			if [ "$(sudo stat -c '%a' ${DELETION})" == 0 ]; then
				sudo rm -rf ${DELETION}
				RSYNC_DELETION=${DELETION##${ISORESPINNER_PARTITION}/upper/}
				sudo rm -rf ${SQUASHFS}/${RSYNC_DELETION}
			fi
		done
		sudo rm -f .rsync.log
		sudo rsync -aXHASx ${ISORESPINNER_PARTITION}/upper/ ${SQUASHFS} 2> /dev/null | sudo tee .rsync.log > /dev/null
		if [ -s .rsync.log ]; then
			if ${MULTI_LAYER_FILESYSTEM}; then
				${PROCESSING_LIVE_SQUASH_LAYERS} && DISPLAY_WARNING "The following issues were encountered updating the '${SQUASH_LAYERS,,}' filesystem layer:" || DISPLAY_WARNING "The following issues were encountered updating the '${SQUASH_LAYERS,,}' language filesystem layer:"
			else
				DISPLAY_WARNING "The following issues were encountered updating the filesystem: "
			fi
			sudo cat .rsync.log | tee -a ${ISORESPINNER_LOGFILE}
			sudo rm -f .rsync.log
		fi
		sudo rm -f .rsync.log
		if [ "${SQUASH_LAYERS}" == "LIVE" ]; then
			if ${INSTALLER_IS_UBIQUITY}; then
				if [ -s ${SQUASHFS}/usr/lib/ubiquity/apt-setup/generators/40cdrom ]; then
					sudo sed -i 's/^\tbail_out/\t: # bail_out/' ${SQUASHFS}/usr/lib/ubiquity/apt-setup/generators/40cdrom
				fi
			fi
			if ${INSTALLER_IS_SNAP}; then
				for SNAP_SQUASHFS in $(sudo find ${SQUASHFS} -type f -name ubuntu-desktop-installer\*snap)
				do
					sudo unsquashfs -d ubuntu-desktop-installer.squashfs ${SNAP_SQUASHFS} > /dev/null 2>&1
					sudo sed -i 's/"update"/"update", "--allow-insecure-repositories"/' ubuntu-desktop-installer.squashfs/bin/subiquity/subiquity/server/apt.py
					sudo sed -i "s/\('apt-get', '--quiet',\)/\1 '--allow-insecure-repositories', '--allow-unauthenticated',/" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/distro.py
					sudo sed -i "s/\('--quiet', '--assume-yes',\)/\1 '--option=Acquire::AllowInsecureRepositories=true', '--option=APT::Get::AllowUnauthenticated=true',/" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/distro.py
					if ${GRUB_32}; then
						sudo sed -i "/if arch == 'i386':/i \
\            bootloader_arch, _ = util.subp(['cat', '/sys/firmware/efi/fw_platform_size'], capture=True)\n\
\            bootloader_arch = bootloader_arch.strip()\n\
\            if bootloader_arch == '32':\n\
\                LOG.debug('isorespinner.sh: Selecting 32-bit grub packages')\n\
\                arch = 'ia32'" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/curthooks.py
						sudo sed -i "/if distro.has_pkg_available(\"shim-signed\"):/i \
\            if bootloader_arch == '32':\n\
\                arch = distro.get_architecture()" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/curthooks.py
						sudo sed -i "s/if \(distro.has_pkg_available(\"shim-signed\"):\)/elif \1/" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/curthooks.py
						sudo sed -i "/if target_arch == 'amd64':/a \
\            bootloader_arch, _ = util.subp(['cat', '/sys/firmware/efi/fw_platform_size'], capture=True)\n\
\            bootloader_arch = bootloader_arch.strip()\n\
\            LOG.debug('isorespinner.sh: Selecting %s-bit grub packages', bootloader_arch)\n\
\            if bootloader_arch == '32':\n\
\                grub_name = 'grub-efi-ia32'\n\
\                grub_target = 'i386-efi'\n\
\            else:" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/install_grub.py
						sudo sed -i "0,/\(grub_name = 'grub-efi-%s' % target_arch\)/{s//\    \1/}" ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/install_grub.py
						sudo sed -i '0,/\(grub_target = "x86_64-efi"\)/{s//\    \1/}' ubuntu-desktop-installer.squashfs/lib/python3.8/site-packages/curtin/commands/install_grub.py
						# kludge to get 32-bit GRUB packages to install
						sudo sed -i "s/self.model.metapkg_name = 'linux-generic'/self.model.metapkg_name = '${LINUX_PACKAGE}'/" ubuntu-desktop-installer.squashfs/bin/subiquity/subiquity/server/controllers/kernel.py
						sudo sed -i "s/package = 'linux-generic'/package = '${LINUX_PACKAGE}'/" ubuntu-desktop-installer.squashfs/bin/subiquity/subiquity/server/controllers/kernel.py
					fi
					sudo rm -rf ${SNAP_SQUASHFS}
					sudo mksquashfs ubuntu-desktop-installer.squashfs ${SNAP_SQUASHFS} > /dev/null 2>&1
					sudo rm -rf ubuntu-desktop-installer.squashfs
				done
			fi
		fi
		sudo rm -f iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASHFS}
		sudo mksquashfs ${SQUASHFS} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASHFS} > /dev/null 2>&1
		if ${MULTI_LAYER_FILESYSTEM}; then
			# recreate ${SQUASH_NAME}.size and ${SQUASH_NAME}.manifest
			SQUASH_NAME=$(basename ${SQUASHFS%.squashfs})
			SQUASHFS_SIZE=$(sudo du -sb --exclude=${SQUASHFS}/proc --exclude=${SQUASHFS}/dev --exclude=${SQUASHFS}/run --exclude=${SQUASHFS}/tmp ${SQUASHFS} | cut -f1)
			sudo rm -f iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.size
			echo ${SQUASHFS_SIZE} | sudo tee iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.size > /dev/null
			sudo chmod 444 iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.size
			if [ -s packages.${SQUASH_LAYERS,,}.added ]; then
				while read PACKAGE
				do
					PACKAGE_NAME=${PACKAGE%%[[:space:]]*}
					if (grep -qsP "^\+${PACKAGE_NAME}\t" iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES}); then
						TMP_PACKAGE=$(grep -P "^\+${PACKAGE_NAME}\t" iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES})
						sudo sed -i "/^+${PACKAGE_NAME}\t/c$(echo +${PACKAGE} | sed 's/ /\t/g')" iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES}
					else
						if [ "${SQUASH_NAME}" != "minimal.standard" ]; then
							echo +${PACKAGE} | sed 's/ /\t/g' | sudo tee -a iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES} > /dev/null
						fi
					fi
				done <<< $(cat packages.${SQUASH_LAYERS,,}.added)
			fi
			if [ -s packages.${SQUASH_LAYERS,,}.removed ]; then
				while read PACKAGE
				do
					PACKAGE_NAME=${PACKAGE%%[[:space:]]*}
					if (grep -qsP "^\+${PACKAGE_NAME}\t" iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES}); then
						sudo sed -i "/^+${PACKAGE_NAME}\t/d" iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${SQUASH_NAME}.${FILESYSTEM_FILES}
					fi
				done <<< $(cat packages.${SQUASH_LAYERS,,}.removed)
			fi
		fi
		sudo rm -rf ${SQUASHFS}
		UNMOUNT_ISORESPINNER_PARTITION
		sudo rm -rf ${ISORESPINNER_PARTITION} ${ISORESPINNER_FILESYSTEM}
	done
	sudo rm -f packages.*.added packages.*.removed
}

function SPIN_ISO {
	DISPLAY_PROGRESS "Spinning ISO ..."
	cd ${WIP}
	cd iso-directory-structure
	sudo rm -f README.isorespinner
	for README_ARRAY in $(seq 0 $((${#README[@]}-1)))
	do
		if [ "${README[${README_ARRAY}]}" == "--update " ]; then
			echo "${README[${README_ARRAY}]}(${MAINLINE_BRANCH})"
		elif [ "${README[${README_ARRAY}]}" == "--${ROLLING} " ]; then
			echo "${README[${README_ARRAY}]}(v${ROLLING_KERNEL_VERSION})"
		elif [ "${README[${README_ARRAY}]:0:13}" == "--repository " ]; then
			echo "${README[${README_ARRAY}]}"
			if ${SOFTWARE_PROPERTIES_COMMON_ADDED}; then
				echo -e "\\t(-p software-properties-common)"
				SOFTWARE_PROPERTIES_COMMON_ADDED=false
			fi
		elif [ "${README[${README_ARRAY}]:0:7}" == "--boot " ]; then
			echo "${README[${README_ARRAY}]}"
		elif [ "${README[${README_ARRAY}]}" == "--interactive " ]; then
			if ${MULTI_LAYER_FILESYSTEM}; then
				for LAYERS in ${SQUASHFS_TYPE,,}
				do
					echo "--interactive (${LAYERS})"
					while read -r
					do
						if [ -n "${REPLY}" ]; then
							echo -e "\\t(${REPLY})"
						fi
					done <<< $(sudo sed 's/\x1B\]0;/\n/' ../interactive-${LAYERS}.log | tr -d '\r' | grep "^[^@]*@$(hostname -s)" | sed 's/^[^ ]* [^ ]* //')
					sudo rm -f ../interactive-${LAYERS}.log
				done
			else
				echo "--interactive"
				while read -r
				do
					if [ -n "${REPLY}" ]; then
						echo -e "\\t(${REPLY})"
					fi
				done <<< $(sudo sed 's/\x1B\]0;/\n/' ../interactive-${SQUASH_LAYERS,,}.log | tr -d '\r' | grep "^[^@]*@$(hostname -s)" | sed 's/^[^ ]* [^ ]* //')
				sudo rm -f ../interactive-${SQUASH_LAYERS,,}.log
			fi
		elif [ "${README[${README_ARRAY}]}" == "--debug " ]; then
			continue
		else
			echo "${README[${README_ARRAY}]}"
		fi
	done | sudo tee README.isorespinner > /dev/null
	cd ..
	# create the iso
	cd iso-directory-structure
	sudo rm -f md5sum.txt
	# new layout for respinning 20.04 ISOs and up
	if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
		echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-${KERNEL_TYPE} > /dev/null
		find \( -path ./boot.catalog -o \
			-path ./boot/grub/fonts -o \
			-path ./boot/grub/i386-efi -o \
			-path ./boot/grub/i386-pc -o \
			-path ./boot/grub/x86_64-efi -o \
			-path ./EFI -o \
			-path ./README.isorespinner \) -prune -o -type f -print0 | sudo xargs -0 md5sum | sudo tee md5sum.txt > /dev/null
	elif [ "${DISTRO_RELEASE}" == "20.04" ]; then
		echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-${KERNEL_TYPE} > /dev/null
		find \( -path ./isolinux -o \
			-path ./README.isorespinner \) -prune -o -type f -print0 | sudo xargs -0 md5sum | sudo tee md5sum.txt > /dev/null
	fi
	sudo rm -f ../.xorriso.log
 	# new approach for respinning 20.10 ISOs and up
	if [ "${DISTRO_RELEASE}" == "22.10" -o "${DISTRO_RELEASE}" == "22.04" -o "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
		sudo bash -c "xorriso -as mkisofs -J -joliet-long -l \
			-iso-level 3 \
			-V \"${ISO_VOLID}\" \
			--grub2-mbr ../iso.mbr \
			--protective-msdos-label \
			-partition_offset 16 \
			--mbr-force-bootable \
			-append_partition 2 0xef ../iso.efi \
			-appended_part_as_gpt \
			-c '/boot.catalog' \
			-b '/boot/grub/i386-pc/eltorito.img' \
			-no-emul-boot \
			-boot-load-size 4 \
			-boot-info-table \
			--grub2-boot-info \
			-eltorito-alt-boot \
			-e '--interval:appended_partition_2:all::' \
			-no-emul-boot \
			-o ../../${LINUXIUM_ISO} . > ../.xorriso.log 2>&1"
	else
		sudo bash -c "xorriso -as mkisofs -J \
			-iso-level 3 \
			-V \"${ISO_VOLID}\" \
			-isohybrid-mbr ../iso.mbr \
			-partition_offset 0 \
			--mbr-force-bootable \
			-iso_mbr_part_type 0x00 \
			-c '/isolinux/boot.cat' \
			-b '/isolinux/isolinux.bin' \
			-no-emul-boot \
			-boot-load-size 4 \
			-boot-info-table \
			-eltorito-alt-boot \
			-e '/boot/grub/efi.img' \
			-no-emul-boot \
			-isohybrid-gpt-basdat \
			-isohybrid-apm-hfsplus \
			-o ../../${LINUXIUM_ISO} . > ../.xorriso.log 2>&1"
	fi
	COMMAND_SUCCESSFUL=$?
	if [ ${COMMAND_SUCCESSFUL} != 0 ]; then
	        DISPLAY_MESSAGE "Failed to create respun ISO as the following issues were encountered: "
	        sudo cat ../.xorriso.log | tee -a ${ISORESPINNER_LOGFILE}
	        FORCED_EXIT
	fi
	sudo rm -f ../.xorriso.log
	cd ..
	sudo rm -f iso.mbr iso.efi
	sudo chown $(stat -c '%u' ${ISO}):$(stat -c '%g' ${ISO}) ../${LINUXIUM_ISO}
	sudo rm -f grub_bootia32.efi efi_bootia32.efi
	sudo rm -rf grub
	sudo rm -rf iso-directory-structure
	cd ${CWD}
	sudo mv ${WIP}/output/* ${WIP}/output/.* ${WIP} > /dev/null 2>&1
	sudo rm -rf ${WIP}/output
	sudo rm -f ${CWD}/.isorespinner.sh.lock
	UMOUNT ${WIP}
	sudo rm -rf ${WIP}
	if [ -z "${WORK_DIRECTORY}" ]; then
		echo "$(basename ${0}): Respun ISO created as '${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPINNER_LOGFILE})' for details."
		echo "Respun ISO created as '${LINUXIUM_ISO}'." >> ${ISORESPINNER_LOGFILE} 2> /dev/null
	else
		echo "$(basename ${0}): Respun ISO created as '${WORK_DIRECTORY}/${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPINNER_LOGFILE})' for details."
		echo "Respun ISO created as '${WORK_DIRECTORY}/${LINUXIUM_ISO}'." >> ${ISORESPINNER_LOGFILE} 2> /dev/null
	fi
}

# isorespinner
CHECK_PACKAGE_DEPENDENCIES
CHECK_FOR_EXCLUSIVITY
NUMBER_OF_ARGUMENTS=${#}
if [ "${NUMBER_OF_ARGUMENTS}" == 0 ]; then
	OPTION_HELP
	FORCED_EXIT
else
	for QUOTED_OPTION in "$@"
	do
		if (expr index "${QUOTED_OPTION}" " " > /dev/null 2>&1); then
			QUOTED_CMDLINE+='"'"${QUOTED_OPTION}"'" '
		elif [ -n "${QUOTED_OPTION}" ]; then
			QUOTED_CMDLINE+="${QUOTED_OPTION} "
		else
			QUOTED_CMDLINE+='"" '
		fi
	done
	CHECK_CMDLINE ${QUOTED_CMDLINE}
fi
${W_OPTION} || CHECK_FOR_SPACE
CHECK_INTERNET_ACCESS
PROCESS_CMDLINE
FORCED_MESSAGE=true
EXTRACT_ISORESPINNER_FILES
EXTRACT_ISO_DIRECTORY_STRUCTURE
MOUNT_SQUASHFS
for SQUASH_LAYERS in ${SQUASHFS_TYPE}
do
	if [ ${SQUASH_LAYERS} == "LIVE" ]; then
		PROCESSING_LIVE_SQUASH_LAYERS=true
	else
		PROCESSING_LIVE_SQUASH_LAYERS=false
	fi
	if ${MULTI_LAYER_FILESYSTEM}; then
		${PROCESSING_LIVE_SQUASH_LAYERS} && DISPLAY_PROGRESS "Processing '${SQUASH_LAYERS,,}' filesystem layer ..." || DISPLAY_PROGRESS "Processing '${SQUASH_LAYERS,,}' language filesystem layer ..."
		if ${DEBUG}; then echo "Processing '${SQUASH_LAYERS,,}' filesystem layer ..." >> ${ISORESPINNER_LOGFILE}; fi
	fi
	CREATE_AND_MOUNT_ISORESPINNER_PARTITION ${SQUASH_LAYERS}
	MOUNT_ISO_CHROOT ${SQUASH_LAYERS}
	${SYSTEMD_CHECKED} || CHECK_FOR_SYSTEMD
	UPDATE_KERNEL_PARAMETERS
	${PROCESSING_LIVE_SQUASH_LAYERS} && UPDATE_BOOTLOADER
	${UPDATE_KERNEL} && INSTALL_MAINLINE_KERNEL
	${PURGE_PACKAGE} && PURGE_PACKAGES
	${DIST_UPGRADE} && UPGRADE_DISTRO
	${UPGRADE} && UPGRADE_DISTRO
	${ADD_KEY} && ADD_KEYS
	${ADD_REPOSITORY} && ADD_REPOSITORIES
	${ADD_PACKAGE} && INSTALL_PACKAGES
	${ADD_LOCAL_PACKAGE} && INSTALL_LOCAL_PACKAGES
	${ADD_FILE} && ADD_FILES
	${ADD_COMMAND} && RUN_COMMANDS
	${INTERACTIVE} && INTERACTION
	UPDATE_GRUB_PACKAGES
	${PROCESSING_LIVE_SQUASH_LAYERS} && UPDATE_ISO_POOL_PACKAGES
	${PROCESSING_LIVE_SQUASH_LAYERS} && UPDATE_FILESYSTEM_MANIFEST_SIZE
	UNMOUNT_ISO_CHROOT
	UNMOUNT_ISORESPINNER_PARTITION
done
UNMOUNT_SQUASHFS
APPLYING_ISORESPINS
UNMOUNT_ISO
SPIN_ISO
${W_OPTION} || ${USING_MEMORY} && CHECK_USED_MEMORY
exit 0
